INSERT INTO `faq_q_a_s` (`id`, `faq_id`, `question`, `answer`, `index`, `created_at`, `updated_at`) VALUES
(1, 1, 'What Type Of Service Do You Provide?', 'We provide Digital Marketing,Web Development,Graphics Design & Data Entry Services.We also cover all part of these services.', NULL, '2022-12-15 11:16:52', NULL),
(2, 1, 'What is Your Pricing Model?', 'We selected our pricing model after global research. And definitely it is budget friendly. We have made 3 types of pricing models like basic, standard, Premium and also offer customized pricing model and services.', NULL, '2022-12-15 11:17:10', NULL),
(3, 1, 'Can I Customize Your Package?', 'We have customization options for you. For each service we have a customized ordering option for you so that you can order as per your requirement.', NULL, '2022-12-15 11:18:28', NULL),
(4, 1, 'How do you prefer to communicate?', 'We can communicate through Email, Whatsapp, Zoom, Google Meet or any other platforms you are comfortable with.', NULL, '2022-12-15 11:18:40', '2022-12-15 11:18:51'),
(5, 1, 'Do You Offer Free Consultation?', 'We Offer 30 Min free Consultation. Our experienced consultants can identify the problem and suggest appropriate solutions for your business and find out the steps you should take before setting a goal.', NULL, '2022-12-15 11:19:14', NULL),
(6, 1, 'Will you provide a detailed report ?', 'We Provide reports for each of our services. Our Specialist team is always ready to deliver your reports. They provide you with daily, weekly, monthly reports according to your services.', NULL, '2022-12-15 11:19:27', NULL),
(7, 2, 'What Type of SEO is Best?', 'There is no term such as Good SEO or Bad SEO. It totally depends on the type of SEO you are conducting to reach your goals. You can conduct a successful SEO campaign if you have a clear vision of what you want and what you are trying to achieve.', NULL, '2022-12-19 07:03:01', '2022-12-19 07:07:41'),
(8, 2, 'Does SEO Really Work for Small Businesses?', 'Yes, SEO does work for small businesses. In fact, many small businesses are holding on to SEO to reach their goals. SEO helps a business to grow and market their products without spending a big fortune. The good thing about SEO is you can target your customers and generate a decent result than the traditional marketing systems and it\'s also pocket friendly too.', NULL, '2022-12-19 07:04:58', NULL),
(9, 2, 'How Many Hours Does SEO Take?', 'Let’s make one thing clear, SEO isn’t a rocket science which can tell when you will see results. The result may come visible within 2 hours to 1 year. It totally depends on some major factors like website crawlability and indexing rate, competitiveness of the keywords, competitors and so on. SEO is a package of efforts put into a website to climb the Search ranks through different techniques. So, no one can guarantee an exact time for a SEO to be completed. But good news is, some results may come visible within 2-3 weeks after conducting a SEO campaign on a website.', NULL, '2022-12-19 07:05:15', NULL),
(10, 2, 'What is The First Thing To Do Before Doing SEO?', 'The first and most important thing to do before doing SEO is to clear the visions and goals you want to achieve through SEO. You can’t expect a good result if you don’t even know what you are doing and what your end goal is after implementing SEO practices to your website. So, before going for SEO services, make it clear to yourself what you want to achieve with SEO.', NULL, '2022-12-19 07:05:31', NULL),
(11, 2, 'What makes a good SEO strategy?', 'It Depends on various terms. To make a good SEO strategy, you must first clear one thing and that is your end goal. Then you can plan your strategy according to your goals and what you want to achieve. But technically, a good SEO strategy consists of proper implementation of best SEO practices in respect of the search engine policies.', NULL, '2022-12-19 07:05:49', NULL),
(12, 2, 'How Can I Improve My SEO Traffic in 30 Days?', 'It depends on the condition of a website and the SEO practices conducted on the website before. If everything goes fine, you may see a major difference in SEO traffic within or less than 30 days. But it may take more time to get SEO traffic to your website if the website is not performing well or SEO is not up to the mark. So, the only way to improve SEO traffic in 30 days is to implement the best SEO strategies possible.', NULL, '2022-12-19 07:06:08', NULL),
(13, 2, 'How Long Should I Pay For SEO?', 'SEO is a long-term process. There is no end to SEO practices as Google and other search engines are changing their algorithm and becoming more efficient day by day. Being a changing sector, you have to work on your SEO until you want to operate your online business. But sometimes it may differ from case to case. As in, if you want local visibility, then 2-3 months of SEO campaign is good enough for you. But corporate or enterprise level SEO has no end as it is a competitive sector and you have to maintain good SEO practices to survive in the competition.', NULL, '2022-12-19 07:06:22', NULL),
(14, 2, 'Do You Take Custom Offers?', 'Yes, we do take custom offers. You can go through our pricings in the page. In case, you need to add or cut some services, you can do that through customization.', NULL, '2022-12-19 07:06:39', NULL),
(15, 6, 'How will technical SEO work?', 'Technical SEO is optimizing a website for Google search to improve its visibility and ranking. It involves improving the site\'s architecture, code, content, and other factors influencing Google\'s ability to index and crawl the site.', NULL, '2022-12-19 08:46:33', NULL),
(16, 6, 'What Do You Need to Start Working?', 'We need your website link, target location, and login info for the website to induce started.', NULL, '2022-12-19 08:46:49', NULL),
(17, 6, 'Which of these aspects is not part of technical SEO?', 'Technical SEO does not include the components listed here. This includes page titles, title tags, HTTP headers, XML sitemaps, 301 redirects, and metadata. Technical SEO does not include analytics, keyword research, backlink profile development.', NULL, '2022-12-19 08:47:15', NULL),
(18, 6, 'Do You Provide Other SEO Services?', 'We provide all types of seo services. We provide On page seo, page seo, technical seo,seo audit, and complete professional seo services. You can choose any type of service which you want for your website.', NULL, '2022-12-19 08:47:28', NULL),
(19, 6, 'Do You Offer Free Audits For My Websites?', 'Yes, we will offer a free audit for your websites & also have 30 min free consultation if you want.', NULL, '2022-12-19 08:47:44', NULL),
(20, 3, 'What do I need to get started?', 'I need several pieces of content - text, images, etc. And, your mailchimp/ or any other email sending account login (if you already have one) to start.', NULL, '2022-12-19 10:01:40', NULL),
(21, 3, 'Can you guarantee success?', 'We can ensure a 90-95% succession rate.', NULL, '2022-12-19 10:01:53', NULL),
(22, 3, 'Why should I hire you?', 'We value your time, money and our commitment towards you.', NULL, '2022-12-19 10:02:06', NULL),
(23, 3, 'Would you provide me urgently?', 'It depends on the requirements and campaign criteria.', NULL, '2022-12-19 10:02:18', NULL),
(24, 3, 'Is the Email template easily editable?', 'Yes, you can customize it anytime you want. If needed, we can help you to do that.', NULL, '2022-12-19 10:02:30', '2022-12-29 10:47:01'),
(25, 3, 'Is DiMarz reliable, Safe and Secure? Is My Data Safe?', 'Your database is securely stored on industry-standard servers in some of the best ISP facilities across the globe. At no point will we sell or share email databases. You may export your list at any time.', NULL, '2022-12-19 10:02:47', NULL),
(26, 3, 'What Campaign Report Will I Get?', 'You will get a full statistical report on open rate, bounce rate, link clicked, unsubscribed, etc.', NULL, '2022-12-19 10:02:59', NULL),
(27, 7, 'Will my email template be responsive?', 'Yes, all the email templates will be responsive and user-friendly for all devices.', NULL, '2022-12-19 10:17:28', '2022-12-29 11:28:12'),
(28, 7, 'Do you have any templates?', 'We have done many email templates. If you want to see sample templates, we will provide you.', NULL, '2022-12-19 10:17:46', NULL),
(29, 7, 'Can I modify my email templates using HTML?', 'Yes, of course. You can modify your email templates. There are different ways to modify email templates using HTML.', NULL, '2022-12-19 10:17:59', NULL),
(30, 7, 'What do I need to start the work?', 'I need your company information, logo, banner, social media link, images, and content you deliver.', NULL, '2022-12-19 10:18:13', NULL),
(31, 7, 'What kind of platform do you use for email templates and marketing?', 'You use the Mailchimp platform for email marketing. Because it is very easy and user-friendly. But you also work on other platforms, like Mailerlite, Aweber, Cover kit, etc.', NULL, '2022-12-19 10:18:31', NULL),
(32, 8, 'What Do You Need to Start Working?', 'We need your website link, target location, and login info for the website to induce started.', NULL, '2022-12-19 11:16:10', '2022-12-19 11:20:18'),
(33, 8, 'What is the process of on-page SEO optimization?', 'The first step is to conduct keyword research to identify which keywords will most likely bring users to your site. Once you have a list of target keywords, you can then start revising your website\'s title tags, meta descriptions, header tags, and body content to include these keywords. In addition, it\'s also essential to ensure that your website\'s URLs are clean and descriptive and that your site is easy to navigate.', NULL, '2022-12-19 11:19:43', NULL),
(34, 8, 'Does This Service Include Keyword Research?', 'Yes, we will do keyword Research for your website. We provide many keywords, including KGR, Long Tail Keyword, Buying Keyword, Informative Keyword, Low Competitive & High Competitive Focused Keyword etc. It depends on your website\'s niche.', NULL, '2022-12-19 11:21:31', NULL),
(35, 8, 'How long will it take to get the project done?', 'We assure you that we will work diligently and efficiently to complete the job as quickly as possible.', NULL, '2022-12-19 11:22:37', NULL),
(36, 8, 'Which business are you looking to provide SEO services for?', 'Whether you have a small business or a larger company, we offer quality SEO services for any business. Our on-page optimization service will help you grow your organic web traffic.', NULL, '2022-12-19 11:23:47', NULL),
(37, 9, 'What does one get to start off-page SEO service?', 'That\'s an excellent question! We want your website URL, Target page URL, Targeted Country, and Focus Keywords.', NULL, '2022-12-19 12:04:52', NULL),
(38, 9, 'How long do the backlinks keep live?', 'The websites I take advantage of are nearly always permanent. If you lose a link, we will compute another placement!', NULL, '2022-12-19 12:05:15', NULL),
(39, 9, 'Are all the links do-follow and permanent?', 'All of the links we provided do follow. So don\'t worry, all of them are permanent links.', NULL, '2022-12-19 12:05:44', NULL),
(40, 9, 'How much time would it take to see the results?', 'Based on your website\'s niche, domain name, competition, and keywords, the SEO process typically takes a couple of weeks to a couple of months. Please be mindful that with search engine optimization, your website will inevitably rise in online search engine ranking.', NULL, '2022-12-19 12:10:59', NULL),
(41, 9, 'Do you build Backlinks for all niches?', 'We don’t accept Adult, Gambling and Cryptocurrency niches.', NULL, '2022-12-19 12:11:45', NULL),
(42, 10, 'How much time is required to create a WordPress website?', 'Building a WordPress website can take several weeks or days, depending on the site\'s complexity and the developer\'s skill level. Most sites take one to two days to build, but it can take longer for more complex sites.', NULL, '2022-12-19 13:48:57', NULL),
(43, 10, 'How long will it take for my website to launch?', 'We offer quick and efficient WordPress websites created for our customer\'s convenience. Some websites can be delivered in as little as 2-3 days, while others may take up to 2-3 weeks due to their particular requirement.', NULL, '2022-12-19 13:49:32', NULL),
(44, 10, 'Can I see the design before building my website?', 'You may be given a website mock-up so that you can see precisely what we\'re working on within the website and make comments on the style and functionality. Once you approve our mock-up, we will work hard on developing the website to its full potential.', NULL, '2022-12-19 13:49:56', NULL),
(45, 10, 'How can I keep track of the WordPress project\'s progress?', 'We\'re happy to talk to you and update you on the progress of your project. Contact us via Skype, email, and phone for unlimited support when working on a longer-term project.', NULL, '2022-12-19 13:50:21', NULL),
(46, 10, 'How Much Does WordPress Development Cost?', 'Every project is different, so the cost of your WordPress development service would depend on the functionality needed in your website. As per global market research, you ensure that we can provide you with a budget-friendly standard service cost.', NULL, '2022-12-19 13:50:46', NULL),
(47, 11, 'How long does it typically take to see results from a Local SEO Service?', 'It depends on various factors like indexing rate, competitors, keyword performance, etc. But, if everything is done correctly, you can see a slight change within 2 weeks.', NULL, '2022-12-20 04:10:18', NULL),
(48, 11, 'What strategies do you use to improve local search engine rankings?', 'There is no extra or special strategy or tricks to rank. All we do is go by the google guidelines and do the basic things which are needed to be done to rank.', NULL, '2022-12-20 04:10:46', NULL),
(49, 11, 'How do you ensure that your local SEO services are compliant with the latest search engine algorithms?', 'We regularly research and update our knowledge according to the day to day changing SEO patterns. We also abide by google rules and regulations.', NULL, '2022-12-20 04:11:15', NULL),
(50, 11, 'How do you measure the success of your local SEO services?', 'There are some factors that work in this case. Some of them are keyword rankings, brand keyword visibility on GMB and others.', NULL, '2022-12-20 04:11:45', NULL),
(51, 11, 'What Login Details I Should Provide You?', 'We need your website admin login details, Google account details (In which your website search console and analytics, GMB are logged in).', NULL, '2022-12-20 04:12:06', NULL),
(52, 11, 'Which Countries & Languages You Cover?', 'We cover any English speaking countries and we work on English only websites.', NULL, '2022-12-20 04:12:23', NULL),
(53, 12, 'What is needed to start working?', 'I need your web site link,target location, and login info for the web site so as to induce start.', NULL, '2022-12-20 04:17:57', NULL),
(54, 12, 'How will I feel  the difference after purchasing the seo service?', 'Normally after 7-12 days of SEO you will understand the difference. Increase your website\'s rank and also visitors will continue to grow. We will provide a detailed worksheet.', NULL, '2022-12-20 04:18:35', NULL),
(55, 12, 'How long will it take to rank my website?', 'It depends. The time it takes for a web site to rank varies. But we will ensure that your websites will better position day by day.', NULL, '2022-12-20 04:19:01', NULL),
(56, 12, 'How long do the backlinks keep live?', 'The websites I take advantage of are nearly always permanent . If you lose a link,we will compute another placement!.', NULL, '2022-12-20 04:19:30', NULL),
(57, 12, 'What to do if you have a difficult problem while working?', 'Well. Thats a good question.If the problem is caused by us,we will fix it to our web developer.But if you already have problems with your sites, you can do it with us or someone else. If you do it with us ,you will pay extra money.', NULL, '2022-12-20 04:20:00', NULL),
(58, 13, 'What types of leads do you provide?', 'We Provide B2B and B2C Leads. Our lead types are, Cold Leads, Warm Leads, Hot Leads, Information Qualified Leads, and Marketing Qualified Leads.', NULL, '2022-12-20 04:20:34', NULL),
(59, 13, 'How many leads can you deliver per day?', 'We have a lead generation team of 20+ members here. We can provide 100 to 1000 leads per day depending on lead type. We provide 100% verified guaranteed leads.', NULL, '2022-12-20 04:20:53', NULL),
(60, 13, 'How accurate are the leads?', 'We use Premium tools for email Verification & if needed we send emails manually to verify.', NULL, '2022-12-20 04:21:10', NULL),
(61, 13, 'Is there a discount available for large orders?', 'Of course, we offer discounts for large orders & we provide advanced excel sheet formulas to maintain sheets & we may provide live google sheet links for large orders. So that you can always check & use leads when your order is in progress.', NULL, '2022-12-20 04:21:32', NULL),
(62, 13, 'Before making an order, can you provide some examples of your work?', 'Sure, Before starting, you can ask for a sample of your targeted leads four to five leads, or you can look at some of our previously completed lead-generation tasks.', NULL, '2022-12-20 04:21:52', NULL),
(63, 13, 'Why should I trust you?', 'We have locations, a website, and an identity. We\'ve completed more than thousands of projects. Check out our recent projects.  Our lead generation specialists have more than five years of experience.', NULL, '2022-12-20 04:22:12', NULL),
(64, 13, 'Can you collect leads from specific Cities or Counties?', 'Most of my orders are location, cities, industries, and keywords based. So, sure, I can target by naming cities within a county or using a mile-based radius around a zip code. However, there is no guarantee that it will all be local as lead generation tools can provide results from all over the place.', NULL, '2022-12-20 04:22:32', NULL),
(65, 14, 'How do you generate leads? Where do they come from?', 'Here are just a few resources we use to find what you need: \n1. LinkedIn Sales Navigator\n2. Internal Databases/Algorithms \n3. Good old-fashioned Manual Web Research\n4. social media\n5. Directory sites and many more!', NULL, '2022-12-20 04:24:02', '2022-12-29 10:40:57'),
(66, 14, 'How can I use this data?', 'Depending on your needs, you can: \r\n1. Send emails in bulk with a common sequence or template. \r\n2. Send by batches, if you have more than 2 products or targets to commercialize or for. \r\n3. Send by batches, if you have more than 2 products or targets to commercialize to or for\r\n4. Individual, to contact each prospect with a custom message. \r\nYou can also make cold-calling campaigns via phone..', NULL, '2022-12-20 04:25:09', NULL),
(67, 14, 'How many leads can you deliver per week?', 'We have a highly experienced and well-maintained team. We can deliver up to 5000+ or more leads per week.', NULL, '2022-12-20 04:25:33', '2022-12-29 10:41:26'),
(68, 14, 'Can you provide a sample work before placing an order?', 'Yes, Of course. You can request for some sample leads before getting started.', NULL, '2022-12-20 04:25:56', NULL),
(69, 14, 'Do you offer a custom Package?', 'Yes, We offer custom packages because of the unique requirements of different store/brands. Send Us a message and let\'s get connected.', NULL, '2022-12-20 04:26:19', NULL),
(70, 15, 'Will you provide sample work before placing a final order?', 'Yes, before the Final order we will provide some sample leads.', NULL, '2022-12-20 04:28:43', NULL),
(71, 15, 'Which platform Do you use for collecting B2C leads?', 'We Use Linkedin, Instagram, Facebook, and other social media platforms for collecting B2C lead.', NULL, '2022-12-20 04:29:04', NULL),
(72, 15, 'What type of information do you need for getting started?', 'We need your target criteria. e.g. Industry, the Location & your condition.', NULL, '2022-12-20 04:29:21', NULL),
(73, 15, 'Can you do an urgent project?', 'Yes, We can do any type of project urgently, We have a team of 20+ specialists who will help you to deliver your project urgently.', NULL, '2022-12-20 04:29:46', NULL),
(74, 15, 'Can I customize your package?', 'Of course, you can choose your package and customize your package following your choice.', NULL, '2022-12-20 04:30:14', NULL),
(75, 15, 'Do you offer any discount For Email Marketing with lead generation?', 'Yes, You will get a price discount if you do email marketing with our collecting leads.', NULL, '2022-12-20 04:30:44', NULL),
(76, 16, 'Will you short your scraping data following city or state wise?', 'If you want a short list of course we will short our scraping data following city or state wise.', NULL, '2022-12-20 04:31:37', '2022-12-29 10:38:50'),
(77, 16, 'Can you scrape any Directory websites out there?', 'lmost. Some of the websites are easy to scrape while some are tough. But almost every  Directory website can be scraped. Let me know details about your desired directory website and I\'ll let you know my quote.', NULL, '2022-12-20 04:31:54', NULL),
(78, 16, 'What if I need Support with Scraping script or Data?', 'Don’t worry. We are available 24/7 for you. You can knock Us anytime and We will try to reach back to you as soon as possible.', NULL, '2022-12-20 04:32:29', '2022-12-29 10:39:12'),
(79, 16, 'Which types of email lists do you provide in this service?', 'For data scraping, you will not get any email list. Data scraping is auto-generated tools & software, it can not get an email list. You will get the company name, location, phone number, google reviews rate, website, google map link, etc.', NULL, '2022-12-20 04:32:55', '2022-12-29 10:40:01'),
