(208, 43, 'Do you provide me full copyrights to the video?', 'When the project is complete, you own full copyrights to the video, and you can use the video anywhere you want.', NULL, '2022-12-20 10:04:09', NULL),
(209, 43, 'How do I get started?', 'First, we will discuss your project & also give you a free consultation about your project. When you agree on our price, and delivery terms we will start our work as soon as possible.', NULL, '2022-12-20 10:04:19', NULL),
(210, 44, 'What should a mock-up include?', 'A mock-up should include a visual representation of what the final product will look like, as well as a detailed description of the product\'s features and/or benefits.', NULL, '2022-12-20 10:04:48', NULL),
(211, 44, 'What if I need the project urgently delivered?', 'We respect your time. That\'s why we also provide urgent delivery within 12 hours. We also have dedicated managers & prioritized support for you. You can also order our custom package.', NULL, '2022-12-20 10:05:10', NULL),
(212, 44, 'What do I need to provide you before starting the project?', 'You can provide us with your product, the title of your product, and also some brief about your design. You can give us your product or business logo if you have one.', NULL, '2022-12-20 10:05:30', NULL),
(213, 44, 'What are the types of mockups?', 'Mockup types can vary depending on the project. Each type of mockup is beneficial for different stages of the design process, so understanding the differences between them can be very helpful.', NULL, '2022-12-20 10:05:51', NULL),
(214, 44, 'How long does it take to create a mock-up?', 'It can take 1-3 Days. It depends on your project. If you ordered many types of mockups, in that case, you need extra time. But if you need urgent delivery, you have a quick delivery option.', NULL, '2022-12-20 10:06:10', NULL),
(215, 45, 'What kind of Real Estate service do you offer?', 'Retouching, colour correction, exposure adjustment, perspective adjustment, backdrop removal, object removal, image cropping, straightening, skydomes, greenery, and other standard real estate photo editing services are all available.', NULL, '2022-12-20 10:27:13', NULL),
(216, 45, 'What do you need to start my project?', 'We need your exact instructions and pictures, and you can give us samples if you want.', NULL, '2022-12-20 10:27:54', NULL),
(217, 45, 'What will happen if I ask for a revision?', 'We try our best and check every detail before submitting it to clients. We are always online to provide revisions at no extra cost if you need revisions. We offer unlimited revision so long as you\'re not satisfied with the quality of your final product.', NULL, '2022-12-20 10:29:04', NULL),
(218, 45, 'How about the quality of your service?', 'We have dedicated graphic designers who ensure their best work with the latest image editing technologies. We make sure your images come out looking like they\'re perfect. Every image is double-checked and edited by our staff to ensure quality.', NULL, '2022-12-20 10:29:49', NULL),
(219, 45, 'What files can you provide me?', 'We can provide you with a high quality resolution of JPEG, PNG, PSD, PDF, and 300 PPI.', NULL, '2022-12-20 10:30:08', NULL),
(220, 46, 'What do I need to provide you to get started?', 'You must send your images in standard format (JPG, JPEG, PNG, RAW, TIF, PSD, etc.). We can provide a great result if you give us a good-resolution image. Give us instructions to edit the image so we can give you the expected result.', NULL, '2022-12-20 10:31:19', NULL),
(221, 46, 'Can You handle my bulk photo editing needs?', 'Of course. Our experienced photo editors team can process more than 500 images daily.', NULL, '2022-12-20 10:31:43', NULL),
(222, 46, 'Can you show me samples?', 'You can submit some of your images to check our editing quality. Also, you can check our website. We have already uploaded our sample editing photos.', NULL, '2022-12-20 10:32:04', NULL),
(223, 46, 'Do you offer the same price for a complex image?', 'Complex images like jewellery and plants require a lot of time. We charge a little bit more for this type of complex image. Please let us know before placing an order & give us a sample so we can give you a reasonable price.', NULL, '2022-12-20 10:32:35', NULL),
(224, 46, 'What file format do you provide?', 'We\'re capable of providing any of the file formats that the client requests. But JPEG is the most convenient format for online photos, and you can easily compress them on websites. PNG is another popular image format.', NULL, '2022-12-20 10:32:55', NULL),
(225, 47, 'Do you deliver urgent files?', 'Yes, we can deliver to you urgently! We have a team and all designers will work for you if you need it urgently.', NULL, '2022-12-20 10:33:42', NULL),
(226, 47, 'Which file format do you accept?', 'We accept JPG, JPEG, PSD, PNG, TIFF, and RAW files.', NULL, '2022-12-20 10:34:12', NULL),
(227, 47, 'Can You handle my bulk photo editing needs?', 'Don\'t worry! Please send us some sample images so we can discuss your bulk order; we have a highly skilled team. They are very efficient and experienced in photo editing, and We can process 500+ images in a day.', NULL, '2022-12-20 10:35:16', NULL),
(228, 47, 'How many revisions do you offer?', 'We want to keep our customers happy, which is why we provide unlimited revisions until they\'re completely satisfied.', NULL, '2022-12-20 10:35:37', NULL),
(229, 47, 'What do you need to get started on my order?', 'We need your pictures and clear instructions to work on your pictures and we can provide you the best quality.', NULL, '2022-12-20 10:36:24', NULL),
(230, 48, 'Which package should I go with?', 'You can go with any package & any custom order. We are always here to provide you with the best services. We work hard to satisfy our clients & try our best for the best result. Feel free to contact us. We will provide you the best services at a reasonable price.', NULL, '2022-12-20 10:37:13', NULL),
(231, 48, 'What happens if I don\'t like your design?', 'Don\'t worry! We always listen carefully until we get the client\'s instructions and requirements right. You can request a revision if you need any changes. We are always here to work with you until you are satisfied. There is no extra charge for revision.', NULL, '2022-12-20 10:37:33', NULL),
