(235, 49, 'What types of vector illustration services do you offer?', 'We provide different types of vector illustration services including\r\nVector Logo Design\r\nPhoto to Vector Design\r\nRaster to vector any kind of image\r\nResize at any custom resolution without losing any quality\r\nColored Illustration\r\ncartoon vector illustration\r\nDesign car vector illustration', NULL, '2022-12-20 11:00:00', NULL),
(236, 49, 'What is the cost of your vector illustration services?', 'Our vector illustration services are highly competitive, with prices starting at just $50. We strive to provide the best quality for the lowest cost, utilizing the latest software and experienced designers.', NULL, '2022-12-20 11:00:58', NULL),
(237, 49, 'What is the turnaround time for vector illustration services?', 'Generally, simple projects can be completed within 1  business days, while more complex projects may take longer.', NULL, '2022-12-20 11:01:20', NULL),
(238, 49, 'Do you provide custom vector illustration services?', 'Yes, we provide custom vector illustration services. Our experienced team of illustrators can create custom illustrations to suit any project.', NULL, '2022-12-20 11:02:01', NULL),
(239, 49, 'What is the format of the output file for vector tracing service?', 'We will provide you file formats and source file,.AI,.EPS,.PDF,SVG,.CDR,300dpi,JPG and PNG.', NULL, '2022-12-20 11:03:36', NULL),
(240, 50, 'Will I be able to edit my website easily despite having no programming knowledge?', 'Yes, you can. We will design your website in a way that you can edit on your own. You will be able to edit easily, add text & images to all pages. You can also edit ecommerce products, their images, descriptions & prices and add unlimited pages and posts.', NULL, '2022-12-20 11:47:28', NULL),
