INSERT INTO `gigpages` (`id`, `category_id`, `mainpage_id`, `title`, `slug`, `sub_title`, `short_description`, `easy_steps`, `overview_title`, `overview_info`, `pricing`, `why_us`, `faq_id`, `meta_info`, `author`, `status`, `created_at`, `updated_at`) VALUES
(4, 1, 2, 'Technical SEO', 'technical-seo-services', 'Technical SEO improve the way your website is crawled, rendered, and indexed', '<h2>The Reason Why you Will Need Technical SEO</h2>\r\n\r\n<p>Technical SEO is the initial and one of the most important parts of a SEO campaign. It is the process where all technical issues are fixed in a website for better user experience and better ranking. Having problems in a website user experience is a major issue for the traffic base as bounce rates get higher and you may even get penalized by google for delivering poor experience. So, it is essential to run a technical SEO on your website.</p>\r\n\r\n<h2>How Technical Optimizations Affect Your SEO?</h2>\r\n\r\n<p>As per recent SEO statistics, if a website takes more than 10 seconds to load then the bounce rate will shoot up to 123%. So, it is clear that Google clearly puts user experience first. Technical optimizations solely work for this particular purpose. We always take technical SEO seriously. Regarding that fact, our team will work thoroughly on your website&#39;s inner issues which are negatively affecting your site&#39;s user experience and performances. By fixing the technical problems you will see a drastic rank promotion in Google.</p>\r\n\r\n<h3>Get a Free Technical Audit</h3>\r\n\r\n<p>In our service, we cover the most important parts of the technical SEO which are directly connected with core web vitals like Speed Optimization, Fix Redirection issues, Image Optimization, HTTPS Setup, Minify/Remove unused scripts, AMP Setup and others. Get a free Technical Audit from us and see what&#39;s going wrong with your website.<br />\r\n&nbsp;</p>', 4, 'Technical SEO Services', '<p>Technical SEO is the practice of improving the crawlability and indexability of your website so that search engines can more easily find and understand your content. We make sure that your site is well-structured and easy to navigate. Investing in Technical SEO services are essential to improving your online visibility and driving traffic to your website.</p>\r\n\r\n<h2>Our Technical SEO Services Include the following:</h2>\r\n\r\n<ul>\r\n	<li>Website Audit</li>\r\n	<li>Google Penalty Check</li>\r\n	<li>Crawlability &amp; Indexability</li>\r\n	<li>SSL Certificate (HTTPS) Enforceability</li>\r\n	<li>XML Sitemap</li>\r\n	<li>404 &amp; 301 Redirection</li>\r\n	<li>Robot text files optimization</li>\r\n	<li>Search Console integration</li>\r\n	<li>Fix website bugs, issues and errors</li>\r\n	<li>Site speed optimization</li>\r\n	<li>Image Optimization</li>\r\n</ul>', 4, '<h2>Why Choose Dimarz For Technical SEO on Your Websites?</h2>\r\n\r\n<ul>\r\n	<li>Provide in-depth analysis</li>\r\n	<li>Improved the performance of your website</li>\r\n	<li>Fixed your Website all Errors&nbsp;</li>\r\n	<li>Bring more organic traffic</li>\r\n	<li>Make sure that your websites will perform better</li>\r\n</ul>', 6, 6, 2, 1, '2022-12-19 09:09:02', '2022-12-19 09:09:02'),
(5, 1, 3, 'Email Template', 'email-template', 'Directly Reach Your  potential Target Audience with the email marketing', '<h2>A Well Designed Email Template Ensures Maximum Succession</h2>\r\n\r\n<p>Email templates is one kind of HTML coded design which allows you to add media or other things like images or links which greatly reflects your business. A good email template makes your statement stand out more than others. So, it is important to design a gorgeous email template to get noticed.</p>\r\n\r\n<h2>What Factors make a Good Email Template?</h2>\r\n\r\n<p>In order to create an effective email template design, it is important to consider the different factors that affect how well a template will perform. This includes the recipient&#39;s unique needs, the tone, and the content of the email. We always consider these facts when designing our client&rsquo;s templates. Our team will design email templates which will convey your message properly to the targeted audiences.&nbsp;</p>\r\n\r\n<h2>Get Your Email Templates Done With DiMarz</h2>\r\n\r\n<p>We provide Email Template Designing Service. Our service covers both small businesses and large organizations. We will create custom email templates that are perfect for any occasion. These templates are easy to use and add value to your emails. When it comes to Email Template Designing, we know what it takes to make sure your sendernews looks great.</p>', 4, 'Email Template Services', '<p>Email templates geared towards any device with an email client allow you to send customized emails that function on any device.An email template is a pre-defined, standard e-mail that can include content like images or text, depending on the design. If your email template looks good &amp; responsive, you will retain your targeted customer. So every email template should be responsive. We will design and code responsive Email Templates and Signatures for your demand. We can create HTML/CSS inline tables, adaptable for desktops, tablets and mobiles.</p>\r\n\r\n<h2>Our Email Templates Services Includes :&nbsp;</h2>\r\n\r\n<ul>\r\n	<li>Optimize for desktop and mobile devices.</li>\r\n	<li>HTML email template that&#39;s professional, responsive, and clickable.</li>\r\n	<li>No copying and pasting is allowed.</li>\r\n	<li>Valid HTML, Inline CSS</li>\r\n	<li>MAJOR EMAIL CLIENT COMPATIBLE</li>\r\n	<li>MailChimp Compatible</li>\r\n</ul>', 5, '<h2>Why Do You Choose us?</h2>\r\n\r\n<ul>\r\n	<li>Safe &amp; secure</li>\r\n	<li>High-quality work</li>\r\n	<li>Customized Design</li>\r\n	<li>Fast &amp; Supper Communication Skills</li>\r\n</ul>', 7, 8, 2, 1, '2022-12-19 10:40:32', '2022-12-19 10:40:32'),
(6, 1, 2, 'On-Page SEO', 'on-page-seo-services', 'Earn more organic  traffic  from search engines with on-page Optimization.', '<h2>Good On-Page SEO Leads To Better Rank</h2>\r\n\r\n<p>On-Page SEO is the key to a healthy and successful SEO campaign. Properly maintaining on-page checklists &nbsp;paves the way to a better ranking opportunity on SERPs. Search Engine Rankings are 70% dependent on website&rsquo;s inner optimizations and contents. Unoptimized and bad website structure will lead to lower ranking positions and eventually get penalized by search engines like google.</p>\r\n\r\n<h2>Why On-Page Plays a Crucial Part in SEO?</h2>\r\n\r\n<p>There are many important factors of SEO which only can be done in On-Page. Some of them are content optimization, keyword research, url, meta tags, headings, alt.tag optimizations and more. Content is the king. This can be only done through On-Page SEO. We have a specialized time who will go through your on-page strategy build ups and forge a competitive strategy to rank your page.</p>\r\n\r\n<h2>Get Your On-Page Done By Professionals</h2>\r\n\r\n<p>At DiMarz, we provide professional on-page SEO services that can help your website reach its full potential. Our team of experienced SEO professionals will analyze your website&#39;s content, structure, and performance to identify key areas of improvement. We will create an effective strategy tailored to your business needs. Our services will help you achieve higher search engine rankings, increased website traffic, and conversions. Our experienced SEO experts will also provide you with ongoing support and advice to ensure that your website remains.<br />\r\n&nbsp;</p>', 4, 'On Page SEO Services', '<p>On-Page SEO Service is the best way to improve your website&#39;s visibility and organic search ranking. It involves optimizing your website&#39;s title, meta tags, header tags, images, and other elements to make it more visible and attractive to search engines. It also helps to create quality content that is keyword-rich and informative. We offer the perfect solution for your on-page SEO needs. We&#39;ll optimize your site for the search engines, which will help you get the traffic and visibility you need to succeed.</p>\n\n<h2>Our On-Page SEO services:</h2>\n\n<ul>\n	<li>Optimize Meta Description</li>\n	<li>Optimize Heading (H1, H2, H3) Tags</li>\n	<li>Optimize Image ALT Tags</li>\n	<li>Optimize Meta Tag</li>\n	<li>Optimize URLs</li>\n	<li>Schema Markup</li>\n	<li>Fix duplicate content&nbsp;</li>\n	<li>Competitor Analysis</li>\n	<li>Keyword Research</li>\n	<li>Content planning &amp; optimization</li>\n	<li>Rank branded &amp; non-branded keywords</li>\n	<li>Keyword Rank tracking &amp; Optimizing</li>\n	<li>Sitemap Submission</li>\n</ul>', 6, '<h2>Why Should You Choose Us?</h2>\r\n\r\n<ul>\r\n	<li>Make sure every aspect of On Page Seo</li>\r\n	<li>In-depth reports on Google&#39;s best practices</li>\r\n	<li>Improved The Ranking Of Your Website.</li>\r\n	<li>Optimize every detail of your website to get the best results.</li>\r\n</ul>', 8, 9, 3, 1, '2022-12-19 11:53:49', '2022-12-19 11:53:49'),
(8, 1, 2, 'OFF Page SEO', 'off-page-seo-services', 'Improving your off-page SEO and backlink profile and bringing more traffic.', '<h2>Better Off-Page SEO Campaign Leads To The Top of SERP</h2>\r\n\r\n<p>Off-Page efforts complete the total SEO campaign of a website. It is like marketing your website in search engines to bring visitors to your websites. Besides, another main cause behind Off-Page is that it helps to build more authority for a website. And, popular search engines like Google promote sites with good authority.&nbsp;</p>\r\n\r\n<h2>Why Should You Hire Professionals For Off-page?</h2>\r\n\r\n<p>Off-page SEO plays a vital role in ranking your website. According to research, the number 1 site on google has 3-4X more backlinks than the rest of the top 10 sites. So, it is mandatory to do your valuable off-page work done by an experienced professional. Another statistic says that 60% of businesses outsource their link-building strategy to an SEO expert. Only 30 % do it in-house. That&rsquo;s why, you should do it with an experienced individual or agency to target the top spot of Google.</p>\r\n\r\n<h2>Grow Your Reputation Over Competitors With DiMarz&nbsp;</h2>\r\n\r\n<p>Our Off-page SEO service provides Link Building, Social Media Optimizations, Brand Visibility Expansion,Quality Backlinking, Guest Posting, Premium Listing, etc. We follow search engine guidelines and conditions so your website&rsquo;s safety is fully guaranteed.The better your website&rsquo;s Off-page score, the more chances you have to beat your competitors and rank on the first page of SERP. Apply Off-page SEO efforts on your website and boost your website&rsquo;s ranking.<br />\r\n&nbsp;</p>', 4, 'OFF Page SEO Services', '<p>Off-page SEO is the process of optimizing a website for the search engines with the goal of improving the site&#39;s ranking in the search results. The main focus of off-page SEO is to build backlinks to the site. Backlinks are links from other websites that point to your website. There are a number of ways to build links, and some of the most common methods include submitting articles to directories, posting in forums, and commenting on blogs,Guest posting.&nbsp;Dimarz offers a specific backlink strategy that is tailored to your website&#39;s niche. We focus on getting your website the visibility it needs so that you can grow your business and benefit from the long-term effects.</p>\r\n\r\n<h2>What to Expect from Dimarz Off-Page SEO Services :&nbsp;</h2>\r\n\r\n<ul>\r\n	<li>High-quality backlinks&nbsp;</li>\r\n	<li>Branded property optimization</li>\r\n	<li>Guest Posting</li>\r\n	<li>External Linking</li>\r\n	<li>Google My Business optimization</li>\r\n	<li>Integrate known search engines (Bing, Yandex, Google)</li>\r\n	<li>Boost ranking</li>\r\n	<li>Organic keywords ranking</li>\r\n	<li>Competitor backlink analysis &amp; link building opportunities</li>\r\n	<li>Professional Email reach (According to Client&#39;s Consent)</li>\r\n</ul>', 8, '<h2>Why Choose You DiMarz?</h2>\r\n\r\n<ul>\r\n	<li>Provide High authority backlink</li>\r\n	<li>Increase Your DA &amp; PA</li>\r\n	<li>Competitor link analysis</li>\r\n	<li>All distinctive Domains Backlinks</li>\r\n</ul>', 9, 11, 3, 1, '2022-12-19 12:30:47', '2022-12-19 12:30:47'),
(51, 1, 1, 'B2B Lead Generation', 'b2b-lead-generation', 'Get Accurate and Converting B2B Leads', '<h2>Why is Lead Generation Essential for Every Business?</h2>\r\n\r\n<p>B2B lead generation is capturing the concentration of intent-rich leads so they can be reached out to and facilitated for sales. It is a fundamental part of the success of any business. Every day you need warm and qualified leads to work with. Implementing the Best B2B lead generation strategy can help you in this sector.</p>\r\n\r\n<h3>Grab the benefits of B2B Lead Generation</h3>\r\n\r\n<p>With B2B Lead Generation, you can expand your market, increase your prospective consumers, Boost your revenue, and generate different types of Business Opportunities, which can help you create visibility for your business module &amp; turning the wave in your favor.&nbsp;</p>\r\n\r\n<h3>Get Qualified Leads With DiMarz</h3>\r\n\r\n<p>The most important part of any marketing policy is generating qualified leads.<br />\r\nOur Lead generation Specialists work with you to fill your sales pipeline with quality leads. We Build a structure and implement a lead generation strategy built upon marketing mechanization, which will bring more qualified leads to your business. So, let DiMarz help you out with your B2B lead generation.</p>', 4, 'B2B Lead Generation', '<p>B2B lead generation is a vital component of any business-to-business sales strategy. It refers to finding and engaging potential customers to turn them into paying customers. Through effective lead generation, businesses can increase their sales and gain valuable insights into their target market. DiMarz can ensure that our &nbsp;quality B2B lead generation is a give assurances and reliable way to grow your business<br />\r\n&nbsp;<br />\r\n&nbsp;<br />\r\nLead Generation Services<br />\r\n&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Any type&nbsp;of Industry&nbsp;</li>\r\n	<li>Small Business Leads</li>\r\n	<li>Real Estate Agent Leads</li>\r\n	<li>Real Estate Business Leads</li>\r\n	<li>Homeowner Leads</li>\r\n	<li>Hvac Leads</li>\r\n	<li>Doctor&rsquo;s Leads</li>\r\n	<li>E-commerce Leads</li>\r\n	<li>Technology Companies Leads</li>\r\n	<li>Restaurant Leads</li>\r\n	<li>500 Startup Companies Leads</li>\r\n	<li>Car &amp; auto Companies leads</li>\r\n	<li>B2C Leads</li>\r\n</ul>\r\n\r\n<p>&nbsp;<br />\r\n<strong>We assure 100% quality of leads (No Bounce)&nbsp;</strong><br />\r\n&nbsp;</p>', 51, '<ul>\r\n	<li>Expert team members&nbsp;</li>\r\n	<li>4+ years of experience</li>\r\n	<li>Non-Bounce &amp; verified leads</li>\r\n	<li>On Time Delivery</li>\r\n	<li>Real Time sheet checking option.</li>\r\n</ul>', 13, 51, 5, 1, '2022-12-20 13:28:28', '2022-12-21 15:35:28'),
(52, 1, 1, 'Web Research', 'web-research', 'With Top-Notch Web Research Gain Insight into Your Target Audience and Develop Strategies to Reach Them', '<h2>Why Do You Need Web Research Service?</h2>\r\n\r\n<p>Web research reveals a wide range of helpful information that businesses and organizations may use in a variety of ways. When you are aware of the vital information of your counterparts, customers, prospects, and competitors, you can easily plan the strategies to expand your reach, increase your sales and gain an edge over your competitors.&nbsp;</p>\r\n\r\n<h3>Web Research Can Benefit Your Bottom Line!</h3>\r\n\r\n<p>By digging through the massive amounts of information from different sources Web analytics professionals can provide you with informative insights while helping you enhance your prospective customer. With our web research services, you will get a Significant reduction in marketing costs, Better comprehension of the competitors, and Wider reach into the target markets across the globe.</p>\r\n\r\n<h3>Get ahead of the curve with Our Web research&nbsp;</h3>\r\n\r\n<p>Our web research services offer an easy solution for all your online and offline research. We have a professional team who are experts on Leads, Property, documents, Products, Events, Financial &amp; different types of Business or company research. We offer completely customized and highly cost-efficient services to aid businesses with the right set of information that they are seeking in the desired format. Run effective web research with DiMarz and get ahead in the competition.</p>', 4, 'Web Research', '<h2>What can you expect from Us?</h2>\r\n\r\n<ul>\r\n	<li>Any type of Industry&nbsp;</li>\r\n	<li>Any type of condition like Revenue, Employee no, etc.</li>\r\n	<li>Small &amp; Multichain detection</li>\r\n	<li>Any type of research Option</li>\r\n	<li>Acquire Companies Data</li>\r\n	<li>Ads Leads</li>\r\n	<li>Amazon, Shopify seller leads</li>\r\n	<li>Copy Paste Work</li>\r\n	<li>Web Research</li>\r\n	<li>Companies Data Research&nbsp;</li>\r\n	<li>Internet Research</li>\r\n	<li>Data Conversion into Excel</li>\r\n	<li>Formatting of excel sheets<br />\r\n	&nbsp;</li>\r\n</ul>', 52, '<h2>Why choose us?</h2>\r\n\r\n<ul>\r\n	<li>20+ lead Generation expert team members&nbsp;</li>\r\n	<li>Long time experience</li>\r\n	<li>Targeting prospective customers</li>\r\n	<li>Result Driven Project</li>\r\n	<li>24/7 customer support<br />\r\n	&nbsp;</li>\r\n</ul>', 14, 52, 5, 1, '2022-12-20 13:44:50', '2022-12-21 15:36:23'),
(53, 1, 1, 'B2C LEAD Generation', 'b2c-lead-generation', 'Acquire Potential Clients Through B2C Lead Generation', '<h2>Get ahead of the competition with B2C lead generation.</h2>\r\n\r\n<p>Businesses with an online presence need to stay competitive to generate more leads and turn those leads into customers. Lead generation is an essential part of moving your business onward. New B2C leads can help your business by building your customer base.</p>\r\n\r\n<h3>Why is B2C Lead Generation the First Choice for Businesses?</h3>\r\n\r\n<p>According to statistics, 79% of Marketers Say Generating Quality Leads is Their Main Goal. With B2C services you can easily reach your target customer, reduce the cost of investment, leverage online B2C selling, and diminish third-party involvement. Your B2C product or service must have something to stand out from your competitors so that your customer chooses you instead of your competitors.</p>\r\n\r\n<h3><br />\r\nUse Our &nbsp;B2C Services to Power Your Businesses</h3>\r\n\r\n<p>With our business-to-consumer (B2C) lead generation services, you can reach more qualified prospects. By understanding your precise needs, we create a custom lead generation strategy that will effortlessly educate, allure, and nurture the interest of your leads to help them recognize the merits of becoming your customer.</p>', 4, 'B2C LEAD Generation Services', '<p>B2C lead generation is acquiring potential customers or clients through various marketing channels. It involves identifying, targeting, and converting individuals who have expressed interest in your product or service. Effective B2C lead generation strategies involve creating valuable content, leveraging digital and traditional channels, using analytics to track progress and refine tactics. We have &nbsp;lead generation specialists who are always available to serve you the best leads.</p>\r\n\r\n<h2>Our B2C Lead Generation Services:&nbsp;</h2>\r\n\r\n<ul>\r\n	<li>Any Business to Customer Leads(B2C)</li>\r\n	<li>Yellow Pages lead</li>\r\n	<li>Linkedin leads</li>\r\n	<li>Lead Generation of any available data</li>\r\n	<li>Data Entry</li>\r\n	<li>Email list building<br />\r\n	&nbsp;</li>\r\n</ul>', 53, '<h2>Why choose us?</h2>\r\n\r\n<ul>\r\n	<li>4+ years of experience</li>\r\n	<li>Non-Bounce &amp; verified leads</li>\r\n	<li>Live sheet checking option</li>\r\n	<li>Skilled Staff</li>\r\n	<li>24/7 customer support<br />\r\n	&nbsp;</li>\r\n</ul>', 15, 53, 5, 1, '2022-12-20 14:10:09', '2022-12-21 15:33:30'),
(54, 1, 1, 'Data scraping', 'data-scraping', 'Take Strategic Business Decisions Through Accurate Data Scraping', '<h2>Data Scraping Services: A Necessity For Your Businesses</h2>\r\n\r\n<p>Data scraping has become important for gathering data from various websites or online sources. With Data Scrapers, data is even easier to compile into a single spreadsheet that is easy to access and use. Data scrapers can find up-to-date data on the internet, making them more valuable than ever. Your ability to extract and analyze web data at scale can constantly be the difference between business failure and success.</p>\r\n\r\n<h3><br />\r\nMake Your Data Collection Process Easier and Faster.</h3>\r\n\r\n<p>Web scraping is a great, easy way to get information from any website quickly and efficiently. Anyone can get more data in an efficient time with low maintenance. By scraping data from your competitor&#39;s website, you can monetize their product or services and discover a new market strategy.</p>\r\n\r\n<h3><br />\r\nGrab &amp; Scrap More Data with Dimarz</h3>\r\n\r\n<p>Our web scraping services help you to do everything from competitive sourcing pricing to auditing trader&#39;s directories to monitoring consumer sentiment. Our data scraping process is dedicated to every stage of developing a strong, secure, scalable &amp; result-oriented solution that meets your needs. Our highly flexible process adapts, evolves, and responds to your exceptional needs. We always Maintain 100% data accuracy at a 50% lower cost.<br />\r\n&nbsp;</p>', 4, 'Data scraping Services', '<p>Data scraping is a process of extracting data from websites and other sources. Organizations commonly use it to gather large amounts of data quickly, often daily. This data can then inform business decisions, track customer trends, or identify growth opportunities. Data scraping is a cost-effective and efficient way to collect data, as it eliminates the need to collect manually, store, and analyze data.</p>\r\n\r\n<h2><br />\r\n&nbsp;Our Data Scraping Services:<br />\r\n&nbsp;</h2>\r\n\r\n<ul>\r\n	<li>Scraping Data from google, Yelp, BBB, Manta, Linkedin, Zoominfo, Apollo</li>\r\n	<li>Trimming the data after scraping.</li>\r\n	<li>Short with city or state wise</li>\r\n	<li>Duplicate checking option</li>\r\n	<li>Web extraction</li>\r\n	<li>Web Scraping tool</li>\r\n	<li>Data collection</li>\r\n	<li>Website Scraping</li>\r\n</ul>', 54, '<h2>Why choose us?</h2>\r\n\r\n<ul>\r\n	<li>Manual Scraping.</li>\r\n	<li>Shorting With your Choice.</li>\r\n	<li>No Duplicate Data</li>\r\n	<li>Clean &amp; clear leads.</li>\r\n</ul>', 16, 54, 5, 1, '2022-12-20 14:42:59', '2022-12-21 15:32:46'),
(55, 1, 3, 'MailChimp Campaign', 'mailchimp-campaign', 'Automate Your Email Sending Process More Efficiently and Professionally', '<h2>Why Use Mailchimp For Email Marketing?</h2>\r\n\r\n<p>Mailchimp is a free email marketing platform that allows you to create and send newsletters, which can reach a large audience. By using Mailchimp, you can increase your list size and get more leads in less time.&nbsp;</p>\r\n\r\n<h3>What Are The Benefits of Using Mailchimp?</h3>\r\n\r\n<p>Mailchimp is a popular email marketing platform that offers a wide range of benefits for businesses. Some of the benefits include:&nbsp;</p>\r\n\r\n<p>1) Increased reach and engagement with your customers: Mailchimp allows businesses to send out unlimited automated emails to their subscribers, which can reach a wider audience. This leads to increased engagement with customers, as they are more likely to click through and take action on the email content.&nbsp;<br />\r\n2) Reduced cost: Mailchimp has an extremely low monthly price point, which means that it is affordable for small businesses who want to use its features. This also leads to increased efficiency as fewer resources are needed to run the campaign, making it more cost-effective overall.<br />\r\n3) Have a good overview of what&rsquo;s going on: With mailchimp, you can keep track of all of the data including open rate, bounce rate, how many people it has reached and who has opened your mail, etc. With this information, you can take next actions according to the data provided.</p>\r\n\r\n<h3>Run Mailchimp Campaign With Us</h3>\r\n\r\n<p>Our Email Marketing Coordinators will run an effective campaign through Mailchimp which will bring better results. Our team is dedicated to creating campaigns that are easy to manage and profitable.&nbsp;<br />\r\n&nbsp;</p>', 4, 'MailChimp Campaign', '<p>Mailchimp is an automated email &nbsp;marketing platform that helps businesses and individuals manage their email marketing campaigns. Mailchimp&rsquo;s automation capabilities enable businesses to send personalized emails to their customers on autopilot, reducing the time spent manually sending emails. With Mailchimp, businesses can create campaigns that are complete to their unique needs and goals, taking advantage of features such as segmentation, automation, and real-time analytics to maximize the effectiveness of their marketing efforts. Hiring a Mailchimp campaign is wise for any business looking to maximize its outreach and marketing efforts.</p>\r\n\r\n<h2><br />\r\nOur MailChimp &nbsp;Campaign Services Including:&nbsp;</h2>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Content Creation &amp; Copywriting</li>\r\n	<li>Landing Pages</li>\r\n	<li>Mailchimp Audit</li>\r\n	<li>Mailchimp Integrations.</li>\r\n	<li>Sign up &amp; PopUp Forms Design</li>\r\n	<li>Campaign Management</li>\r\n	<li>Upload/Format/Remove Email List</li>\r\n	<li>Mailchimp template Newsletter Design<br />\r\n	&nbsp;</li>\r\n</ul>', 55, '<h2>Why Choose Dimarz for your Campaign?</h2>\r\n\r\n<ul>\r\n	<li>Professional, Editable and Creative design.</li>\r\n	<li>Eye-catching outlook.</li>\r\n	<li>Creative and Latest design version.</li>\r\n	<li>Less bounce rate<br />\r\n	&nbsp;</li>\r\n</ul>', 27, 55, 5, 1, '2022-12-20 15:00:59', '2022-12-21 15:31:04'),
(56, 1, 3, 'Campaign Management', 'campaign-management', 'Manage Your Email Campaigns With Professionals', '<h2>A Good Campaign Management Can Earn Better Conversion Rate</h2>\r\n\r\n<p>Campaigns have to be planned, executed and monitored in order to achieve the desired goal. But this task is not as easy as it seems. A good email campaign consists of various things to make it successful. So, it is very important to choose the right person and right tools to run a data driven email campaign.</p>\r\n\r\n<h2>What Factors Make a Good Email Campaign?</h2>\r\n\r\n<p>Email campaigns are important because they allow businesses to connect with their customers in a convenient, automated way. However, there are a few factors that make an email campaign successful. First, the email should be well-written and informative. Second, it should be relevant to the customer&rsquo;s current situation. Third, the message should be easy to understand and follow. Finally, the email should be well-timed and relevant to the customer&rsquo;s needs. Our team will manage your email campaign keeping these aspects in mind.</p>\r\n\r\n<h2>Why Choose DiMarz For Your Campaign Management?</h2>\r\n\r\n<p>We provide Email Campaign Management Service. Our service is designed to help clients manage their email campaigns in a way that is efficient and effective. We work with clients to create goal-driven email campaigns that are tailored to their specific needs and goals. Our service offers a range of options, including automated email campaign creation, editing and managing your campaigns, and tracking your results. Whether you are looking for help setting up your first email campaign or want to keep tabs on your recent campaigns, we have the solution for you. Manage Your Email Campaign with professionals.<br />\r\n&nbsp;</p>', 4, 'Campaign Management Service', '<p>Email campaign management is an effective way to reach a large number of customers quickly. Email campaigns allow for targeted, personalized messaging, enabling companies to reach a diverse audience. If you have a successful campaign management strategy, you will send the email to your targeted audience at the right time. Hiring an experienced email marketing campaigner provides a great opportunity to reach a targeted &nbsp;audience, improve customer relationships, and increase sales conversions.</p>\r\n\r\n<h2><br />\r\nOur Email Campaign Management Services Including :</h2>\r\n\r\n<ul>\r\n	<li>Welcome message</li>\r\n	<li>Automation</li>\r\n	<li>Account set up</li>\r\n	<li>Content Creation</li>\r\n	<li>Complete email marketing funnel</li>\r\n	<li>Newsletter templates</li>\r\n	<li>Account management</li>\r\n	<li>Landing Page</li>\r\n	<li>Responsive Template Design<br />\r\n	&nbsp;</li>\r\n</ul>', 56, '<h2>Why Choose DiMarz For Your Email Campaign Management</h2>\r\n\r\n<ul>\r\n	<li>Professional &amp; Creative design.</li>\r\n	<li>Responsive Design</li>\r\n	<li>Dedicated Email Marketer For Each campaign</li>\r\n	<li>Low bounce rate<br />\r\n	&nbsp;</li>\r\n</ul>', 28, 56, 5, 1, '2022-12-20 15:13:25', '2022-12-21 15:30:13'),
(57, 1, 3, 'Email signature', 'email-signature', 'Make Outstanding Email Signatures That Represents Your Business', '<h2>Make Your Email More Professional</h2>\r\n\r\n<p>A well personalized email signature enhances your email&rsquo;s conversion rate. Adding a signature mentioning your company, logo, brand color and contact information will make your mail more appealing and unique rather than a bland text email. A well- designed email signature will help individuals know who sent it and what it represents.</p>\r\n\r\n<h2>How To Make Your Email Signature More Eye-Catchy?</h2>\r\n\r\n<p>There are a few things to consider while making an email signature more eye-catching. For instance, choosing an easily-read font, bold or underline typeface for more emphasis, adding keywords or other interesting content to the signature. And finally, putting a photo or image to help promote the message. Our team will design you a decent signature according to the requirements stated above.</p>\r\n\r\n<h2>Design an Outstanding Email Signature That Stands out</h2>\r\n\r\n<p>Our Email signature Service is the perfect way to easily and securely signature your emails.We provide a unique and easy-to-use signature solution that makes signing your emails more convenient. With our service, you can easily and securely sign your emails, ensuring that your messages are delivered as expected.</p>\r\n\r\n<p>Get your email signature design done with us and stand out of the crowd.<br />\r\n&nbsp;</p>', 4, 'Email Signature Services', '<p>An email signature is the best way to ensure a professional, consistent appearance across your emails. Keeping the same signature for all emails can easily create a recognizable and consistent look for your company. An email signature can also create a sense of professionalism for your organization. DiMarz offers you professionally designed email signatures to help create a professional look. With a professional email signature, businesses can make a positive impression on customers and prospects, create a uniform look across the organization, and enhance their brand identity.</p>\r\n\r\n<h2>Our Services including :</h2>\r\n\r\n<ul>\r\n	<li>HTML Email Signature&nbsp;</li>\r\n	<li>Any specific design based HTML Email signature</li>\r\n	<li>Mobile Compatible HTML Email Signature</li>\r\n	<li>Add Business icons for Contact Details.</li>\r\n	<li>Clickable Email Signature<br />\r\n	&nbsp;</li>\r\n</ul>', 57, '<h2>Why Choose Dimarz ?</h2>\r\n\r\n<ul>\r\n	<li>HTML code file.</li>\r\n	<li>100% clickable signature.</li>\r\n	<li>Clickable Social Icons.</li>\r\n	<li>Eye-catching design.</li>\r\n	<li>Full refund if you are not satisfied.</li>\r\n</ul>', 29, 57, 5, 1, '2022-12-20 15:25:50', '2022-12-21 15:28:58'),
(58, 1, 2, 'Monthly SEO Service', 'monthly-seo-service', 'Take Your Website To The Top of SERP With Monthly SEO', '<h2>Just Having a Website Isn&rsquo;t Enough, It Needs To Be Search Engine Optimized</h2>\r\n\r\n<p>There are many websites out there on the internet which are not getting the expected results. That&rsquo;s because their websites are not fully search engine optimized. An optimized website can bring a ton of potential customers or audiences to your website without spending extra money. And a fully search engine optimized website ranks top of a search engine which also is admired by people because search engines tend to rank websites which add value to their audiences.</p>\r\n\r\n<h2>How Can You Benefit From SEO?</h2>\r\n\r\n<p>By doing SEO on your website, you will have a better chance to rank your pages on top of search engine ranking positions. It will enable you to get exposure for your site to a wide range of audience who are looking for things relevant to your niche. As per AHrefs, 68% online experience starts with a search engine. So, there are higher chances for your business to get more qualified leads and customers. Regarding this, a stat from Hubspot shows that SEO leads have a 14.6% close rate. That&rsquo;s why having a fully optimized website is really important for a website.</p>\r\n\r\n<h2>Get Full SEO Service From DiMarz?</h2>\r\n\r\n<p>At DiMarz, our professional SEO consultants will take care of your website and help in order to reach the top spot of your desired search engine. We have a specialized SEO team who are looking over the different sectors of SEO as in Technical, On-Page, Off-Page, Content Writing, etc. Together we are committed to rank your site to the first page of any search engine. Start Your SEO campaign with us and rest easy!<br />\r\n&nbsp;</p>', 4, 'Monthly SEO Service', '<p>Seo is the practice of optimizing your web pages to make them reach a high position in the search results of Google and other search engines. There are many types of seo. On page optimization, &nbsp;Technical Seo, Off page Seo,link building,local seo etc. We provided you full seo service in this package.We will ensure you that your websites will rank better and get more traffic after our service.<br />\r\n&nbsp;</p>\r\n\r\n<h2>Our SEO Services :<br />\r\n&nbsp;</h2>\r\n\r\n<h3>TECHNICAL:</h3>\r\n\r\n<ul>\r\n	<li>Website Audit</li>\r\n	<li>Google Penalty Check</li>\r\n	<li>Crawlability &amp; Indexability</li>\r\n	<li>Canonicalization</li>\r\n	<li>SSL Certificate (HTTPs) Enforceability</li>\r\n	<li>XML Sitemap</li>\r\n	<li>404 &amp; 301 Redirection</li>\r\n	<li>Robot txt files optimization</li>\r\n	<li>Search Console integration</li>\r\n	<li>Analytics, heatmap setup</li>\r\n	<li>Fix website bugs ,issues and errors</li>\r\n	<li>Site speed optimization<br />\r\n	&nbsp;</li>\r\n</ul>\r\n\r\n<h3>ON-PAGE:</h3>\r\n\r\n<ul>\r\n	<li>Optimize Meta Description</li>\r\n	<li>Optimize Heading (H1, H2, H3) Tags</li>\r\n	<li>Optimize Image ALT Tags</li>\r\n	<li>Optimize Meta Tag</li>\r\n	<li>Optimize URLs</li>\r\n	<li>Schema Markup</li>\r\n	<li>Fix duplicate content &amp; stop words from URLs</li>\r\n	<li>Competitor Analysis</li>\r\n	<li>Organic Keyword analysis</li>\r\n	<li>Content planning, Enhance &amp; improvement</li>\r\n	<li>Rank branded &amp; non-branded keywords</li>\r\n	<li>Keyword Rank tracking &amp; Optimizing<br />\r\n	&nbsp;</li>\r\n</ul>\r\n\r\n<h3>OFF-PAGE:</h3>\r\n\r\n<ul>\r\n	<li>High-quality backlinks (50-100/Month)</li>\r\n	<li>Branded property optimisation</li>\r\n	<li>Google My Business optimisation</li>\r\n	<li>Integrate known search engines (Bing, Yandex, Google)&nbsp;</li>\r\n	<li>Boost ranking</li>\r\n	<li>Organic keywords ranking&nbsp;</li>\r\n	<li>Competitor backlink analysis &amp; link building opportunities</li>\r\n	<li>Professional Email reach</li>\r\n</ul>', 58, '<h2>Why did you choose us?</h2>\r\n\r\n<ul>\r\n	<li>100% elaborated Report</li>\r\n	<li>We improved the ranking of your web site.</li>\r\n	<li>Authority profiles Backlinks</li>\r\n	<li>High Quality Link building</li>\r\n	<li>On time delivery and 24/7 client support<br />\r\n	&nbsp;</li>\r\n</ul>', 12, 58, 5, 1, '2022-12-20 15:37:23', '2022-12-21 15:18:07'),
(59, 1, 2, 'Local SEO', 'local-seo', 'Increase Your Websites Local Visibility', '<h2>Importance of Local SEO</h2>\r\n\r\n<p>Local SEO is important for businesses of any size that wish to increase their online visibility locally. It helps to target local customers by optimizing content for local searches, which helps businesses to show up higher in search engine results. Local SEO is also beneficial for businesses because it helps to increase the relevance of their content and boost the chances of being found by potential customers. Additionally, local SEO is an important way to build authority in the local market and establish a credible presence in the local community. When businesses use local SEO effectively, they will see an increase in both website traffic and leads. It makes local SEO a valuable asset for any business that wishes to grow its online presence and reach its local audience.</p>\r\n\r\n<h2>How We Will Locally Optimize Your Visibility</h2>\r\n\r\n<p>Local SEO is an important aspect of a business in today&#39;s competitive landscape. It is the optimization method of a website to make it more visible for local searches. This optimization includes creating local content that matches the keywords used by potential customers when searching for a business, ensuring the website is accurately listed in local directories, and utilizing local link-building tactics to increase exposure. Local SEO also focuses on optimizing content for mobile devices, as most local searches are conducted via a mobile device. Additionally, local SEO involves optimizing for location-based services such as Google My Business, Apple Maps, and Yelp. By implementing local SEO strategies, businesses can increase their visibility and reach more local customers, leading to increased sales and growth.</p>\r\n\r\n<h2>Boost Your Local Authority with DiMarz</h2>\r\n\r\n<p>We provide Local SEO services for businesses looking to leverage their local presence and reach more customers. Our experienced team of SEO professionals can help you create an effective local search strategy that will increase your visibility and improve your ranking in local search results. We specialize in optimizing websites for local searches, providing customized solutions suited to your business needs. Our services include keyword research and analysis, content optimization, website optimization, and link building. We also provide ongoing tracking and analysis to ensure the success of your local SEO efforts. With our help, you can ensure that the right people will see your business at the right time.<br />\r\n&nbsp;</p>', 4, 'Local SEO Services', '<p>Businesses can profit at a larger margin if they locally optimize their website for their local people. Local SEO can help you in that matter. In this process, we locally rank your keywords to your desired location so that people around there can get access to your website.Local SEO also monitors the business&#39;s search engine rankings and makes adjustments as needed to ensure that customers can find the business online. Overall, local SEO is important for businesses looking to stay competitive in the digital age.<br />\r\n&nbsp;</p>\r\n\r\n<h2>What to Expect from Dimarz Local SEO Services :&nbsp;<br />\r\n&nbsp;</h2>\r\n\r\n<ul>\r\n	<li>On Site Optimization</li>\r\n	<li>Google My Business Optimization</li>\r\n	<li>Local Citations</li>\r\n	<li>GMB Posts</li>\r\n	<li>Link Building (Local)</li>\r\n	<li>Schema Markup</li>\r\n	<li>Content Planning</li>\r\n	<li>Bi-Monthly Report<br />\r\n	&nbsp;</li>\r\n</ul>', 59, '<h2>Why choose us?</h2>\r\n\r\n<ul>\r\n	<li>100% elaborated Report</li>\r\n	<li>We improved the ranking of your web site.</li>\r\n	<li>Authority profiles Backlinks</li>\r\n	<li>High Quality Link building</li>\r\n	<li>On time delivery and 24/7 client support<br />\r\n	&nbsp;</li>\r\n</ul>', 11, 59, 5, 1, '2022-12-20 15:52:51', '2022-12-21 15:27:47'),
(60, 1, 5, 'Blog Content', 'blog-content', 'Through blogging, customers can discover more about your business.', '<h2>Blog That Gets Traffic And Builds Authority In Your Niche</h2>\r\n\r\n<p>Blogs are a great way to share your ideas and insights. But increasing the frequency and quality of your blog posts can be daunting. It has become a trendy thing in today&#39;s world as the number of affiliate marketers and bloggers are increasing drastically. Blogging has become a great source of income in recent years. There are many factors that come along with it like writing authenticity, hierarchy, topical authority, SEO, etc.&nbsp;</p>\r\n\r\n<h2>Things To Consider While Writing Blogs</h2>\r\n\r\n<p>There are a few things you should consider while writing a blog post. These include topics you want to address, the tone of your post, and whether or not you want to use images. Other important factors should be taken into consideration like writing intent, topical authoritativeness, effective introductions and conclusions, SEO, etc. Our writers are well versed in these terms while writing blogs for clients. We will provide you standard, error-free and SEO friendly blogs which will engage more audiences to read your piece of content.</p>\r\n\r\n<h2>Start Blogging With DiMarz</h2>\r\n\r\n<p>Our easy-to-read style and engaging blog writing will keep your readers engaged, even on the most difficult assignments. We understand the importance of SEO, and we will also make sure that your content gets fully search-engine optimized.<br />\r\n&nbsp;</p>', 4, 'Blog Content Services', '<p>Blog content writing is an essential part of any online marketing strategy. It involves creating engaging, informative, and entertaining content for readers of a blog or website. By creating content that meets the specific needs of the target audience, content writers can help to drive traffic to your blog website. Content writers can advise how to structure the content for maximum reach and impact. Additionally, content writers can research and curate content related to a business&#39;s industry, helping to establish the company as an authority in its field.</p>\r\n\r\n<h2>Our Blog Content Writing Services Including :&nbsp;</h2>\r\n\r\n<ul>\r\n	<li><span style=\"display:none\">&nbsp;</span>Depth keyword research &amp; Implementation</li>\r\n	<li>SEO-optimized posts</li>\r\n	<li>Header Tags Optimized</li>\r\n	<li>Titles &amp; Meta Descriptions Provided</li>\r\n</ul>', 60, '<h2>Why Choose DiMarz for your Blog Websites?</h2>\r\n\r\n<ul>\r\n	<li>We write content that performs long-term</li>\r\n	<li>We write 100% manual writing</li>\r\n	<li>We don&#39;t use AI tools</li>\r\n	<li>We are honest about our work</li>\r\n</ul>', 17, 60, 3, 1, '2022-12-21 12:01:06', '2022-12-21 12:01:06'),
(61, 1, 5, 'Websites CopyWriting', 'websites-copywriting', 'Great copywriting services are aware of the need to convey a sense of urgency in their writing.', '<h2>Why You Need SEO Friendly &amp; Engaging Website Copywriting Service</h2>\r\n\r\n<p>A website landing page should be written in a way which should be both optimized for search engine visibility and engaging for readers. Only professional copywriters can craft content that highlights your company&rsquo;s strengths and appeals to potential customers. A website copy is written to be more easily found through organic searches and contains keywords and phrases that will draw more visitors to your site. Additionally, the content is written engagingly, encouraging readers to take action, such as visiting your business, signing up for a newsletter, or purchasing a product. With an SEO Friendly and Engaging Website Copywriting Service, you can reach a wider audience while ensuring your business is seen as a trusted source.</p>\r\n\r\n<h2>The Main Aspects of Website Copywriting</h2>\r\n\r\n<p>Website copywriting is creating persuasive, compelling, and engaging content for websites. It is an essential tool for businesses to bring in more customers, gain more conversions, and generate higher profits. The main aspects of website copywriting include the following:</p>\r\n\r\n<ul>\r\n	<li>Keyword research.</li>\r\n	<li>SEO writing.</li>\r\n	<li>Creating persuasive calls to action.</li>\r\n	<li>Optimizing content structure.</li>\r\n	<li>Ensuring the content is clear and concise.</li>\r\n</ul>\r\n\r\n<p>Keyword research focuses on understanding the words and phrases used by potential customers to find the business&rsquo;s services or products. SEO writing is the process of creating content that is optimized for search engine visibility. Creating persuasive calls to action encourages visitors to take the desired action. Optimizing content structure helps the user experience by providing a clear message and directing the user&rsquo;s focus. Lastly, ensuring the content is clear and concise for readers.<br />\r\n&nbsp;</p>', 4, 'Websites CopyWriting Services', '<p>Website Copywriting is the process of producing written content for websites. This content needs to be engaging and attention-grabbing while still conveying the right message and purpose of the website. It should be written in a tone that reflects the target audience and should be easy to read. It should also be completed to the website&#39;s goals, whether to increase sales, inform customers, or build an online presence. Professional website copywriters should have a good understanding of the target audience and the website&#39;s goals and be able to craft unique and captivating content. They should also have a good understanding of SEO and the ability to craft content for desktop and mobile website versions.</p>\r\n\r\n<h2>Our Website Copywriting Services:</h2>\r\n\r\n<ul>\r\n	<li>Keyword Implementation</li>\r\n	<li>Engaging Writing</li>\r\n	<li>Write For Any Landing Pages</li>\r\n	<li>Eye-Catchy Title</li>\r\n	<li>Basic SEO Setup</li>\r\n	<li>Writing Meta Tags and Schema (Premium Package Only)</li>\r\n</ul>', 61, '<h2>Why Choose us</h2>\r\n\r\n<ul>\r\n	<li>100% unique and updated according to the latest trends</li>\r\n	<li>No grammatical errors/correct sentence structure</li>\r\n	<li>Free of Any Kind of Spun or Plagiarism</li>\r\n	<li>Proofreading Through Premium Tools</li>\r\n	<li>SEO Friendly</li>\r\n	<li>Timely delivery</li>\r\n	<li>24/7 availability</li>\r\n	<li>Full customer support and</li>\r\n	<li>Mulltiple revisions until satisfaction<br />\r\n	&nbsp;</li>\r\n</ul>', 18, 61, 3, 1, '2022-12-21 12:28:39', '2022-12-21 12:28:39'),
(62, 1, 5, 'Social Media Content', 'social-media-content', 'With a social media presence that engages, inspires your audience, you can give your brand an identity.', '<h2>Create Powerful Social Media Content That Will Get Your Customers Interested&nbsp;</h2>\r\n\r\n<p>Social Media is a very powerful platform where your content creates a great impact. It can be used to build relationships, promote your brand, and connect with customers. However, you need to understand the risks and benefits of using social media to create content otherwise your content will have no impact on your readers whether it is a long post or just a single caption.</p>\r\n\r\n<h2>Why Social Media Contents Matter The Most?</h2>\r\n\r\n<p>Social media has become an essential tool for relationships and communication. The most important thing social media can do is provide people with reliable and up-to-date information, which is why it&rsquo;s so important that content on social media should be accurate and relevant. Keeping that in mind, we will craft content that will be genuine, well researched and add value to your audiences.</p>\r\n\r\n<h2>Craft Impactful Social Media Contents With DiMarz</h2>\r\n\r\n<p>Our professional social media writing service provides quality, engaging content to help you stand out. Plus, our team is flexible and available to work with any social media platform, whether an article or caption.<br />\r\n&nbsp;</p>', 4, 'Social Media Content Services', '<p>Social media content has become a valuable asset for businesses and individuals. It can help to build relationships, attract new customers, and spread awareness about a product or service.By using social media content to inform and entertain, businesses can now gain followers and build a loyal customer base.A social media content writer can help you create high-quality content that is both entertaining and informative.So hiring a social media content writer is a great way to ensure your company is reaching its target audience in the most effective way possible.</p>\r\n\r\n<h2>Our Social Media Content Writing Services :</h2>\r\n\r\n<ul>\r\n	<li>Scheduling/Posting creative and relevant posts/content.&nbsp;</li>\r\n	<li>Optimized social media description</li>\r\n	<li>For all social media, specific formatting and optimization</li>\r\n	<li>Product descriptions based on ads</li>\r\n	<li>Ad copywriting</li>\r\n	<li>Hashtag research &amp; indexing.&nbsp;</li>\r\n	<li>Engaging and well-written Captions.&nbsp;</li>\r\n	<li>Keyword optimized content</li>\r\n	<li>Paid stock images and visual content for posts.</li>\r\n</ul>', 62, '<h2>Why Choose us?</h2>\r\n\r\n<ul>\r\n	<li>Engaging campaign content</li>\r\n	<li>Listen and analyze</li>\r\n	<li>Following creativity and uniqueness</li>\r\n</ul>', 19, 62, 3, 1, '2022-12-21 12:45:13', '2022-12-21 12:45:13');
