(1, 'Software Engineer', 'software-engineer128', 4, 'Full-time, Part Time, Remote', '<h4>Job description</h4>\r\n\r\n<p>There are many variations of passages of Lorem Ipsum available, but the majority have suffered alteration in some form, by injected humour, or randomised words which don&#39;t look even slightly believable. If you are going to use a passage of Lorem Ipsum, you need to be sure there isn&#39;t anything embarrassing.</p>\r\n\r\n<p>Variations of passages of lorem Ipsum available, but the majority have suffered alteration in some form, by injected humour, or randomised words which don&#39;t look even slightly believable. If you are going to use a passage of Lorem Ipsum, you need to be sure there isn&#39;t anything embarrassing.</p>\r\n\r\n<h4>Responsibility</h4>\r\n\r\n<ul>\r\n	<li>The applicants should have experience in the following areas.</li>\r\n	<li>Have sound knowledge of commercial activities.</li>\r\n	<li>Leadership, analytical, and problem-solving abilities.</li>\r\n	<li>Should have vast knowledge in IAS/ IFRS, Company Act, Income Tax, VAT.</li>\r\n</ul>\r\n\r\n<h4>Qualifications</h4>\r\n\r\n<ul>\r\n	<li>The applicants should have experience in the following areas.</li>\r\n	<li>Have sound knowledge of commercial activities.</li>\r\n	<li>Leadership, analytical, and problem-solving abilities.</li>\r\n	<li>Should have vast knowledge in IAS/ IFRS, Company Act, Income Tax, VAT.</li>\r\n</ul>\r\n\r\n<h4>Benefits</h4>\r\n\r\n<p>There are many variations of passages of Lorem Ipsum available, but the majority have suffered alteration in some form, by injected humour, or randomised words which don&#39;t look even slightly believable. If you are going to use a passage of Lorem Ipsum, you need to be sure there isn&#39;t anything embarrassing.</p>', '2023-01-04', '2022-12-25 12:16:39', NULL),
(2, 'SEO Expert/ SEO Lead', 'seo-expert-seo-lead138', 3, 'Full-time, Part Time, Remote', '<h4>Job Context</h4>\r\n\r\n<ul>\r\n	<li>We are looking for SEO specialists with proven experience in SEO and good knowledge on SEO.</li>\r\n	<li>The ideal candidates have strong analytical, managerial, researching, and presentation skills with experience and knowledge in SEO.</li>\r\n	<li>Daily updates collects from team members and should take responsibility for goal achieving.</li>\r\n	<li>Who has excellent written and communication skills in English.</li>\r\n</ul>\r\n\r\n<h4>Job Responsibilities</h4>\r\n\r\n<ul>\r\n	<li>Researching, Planning, Team leading and Executing SEO projects.</li>\r\n	<li>Set up a straightforward plan that can rank any website for its target keyword within the quickest possible time.</li>\r\n	<li>Complete website audit, keyword research, competitor&#39;s analysis, metadata analysis, bounce rate reduction, backlink generation, page size, and speed optimization, etc.</li>\r\n	<li>Conduct in-depth keyword research using premium tools like ahrefs, moz, keywordeverywhere extension, keyword revealer, keywordtool.io etc.</li>\r\n	<li>Leadership skills for junior employee/team member guiding for article writing, social media post, backlinks creates etc supportive works.</li>\r\n	<li>Qualify websites and content publishers for potential link building opportunities, including forums, directories, guest posting, infographic posting, and sponsored posts.</li>\r\n	<li>Review technical SEO issues and recommend fixes.</li>\r\n	<li>Reviewing and analyzing website content and blog posts for writing new topics with good title/keywords-based articles and posts.</li>\r\n	<li>If you have knowledge or experience for car industry or digital product selling, it will be a plus point.</li>\r\n</ul>\r\n\r\n<h4>Employment Status</h4>\r\n\r\n<p>Full-time</p>\r\n\r\n<h4>Educational Requirements</h4>\r\n\r\n<ul>\r\n	<li>Bachelor degree in any discipline</li>\r\n	<li>Proven SEO ranking portfolio.</li>\r\n	<li>Preferred Professional Certification: SEO</li>\r\n	<li>Skills Required: Off Page SEO, On page SEO, Search Engine Optimization (SEO), SEO, SEO and Digital Marketing, Technical SEO, YouTube SEO</li>\r\n</ul>\r\n\r\n<h4>Experience Requirements</h4>\r\n\r\n<ul>\r\n	<li>At least 4 year(s)</li>\r\n	<li>The applicants should have experience in the following area(s):<br />\r\n	Search Engine Optimization (SEO), SEO and Digital Marketing</li>\r\n	<li>The applicants should have experience in the following business area(s):<br />\r\n	Automobile, Direct Selling/Marketing Service Company</li>\r\n</ul>\r\n\r\n<h4>Additional Requirements</h4>\r\n\r\n<ul>\r\n	<li>Age 24 to 32 years</li>\r\n	<li>Only males are allowed to apply</li>\r\n</ul>\r\n\r\n<h4>Job Location</h4>\r\n\r\n<p>Dhaka (Vatara)</p>\r\n\r\n<h4>Salary</h4>\r\n\r\n<ul>\r\n	<li>Tk. 20000 - 30000 (Monthly)</li>\r\n</ul>\r\n\r\n<h4>Compensation &amp; Other Benefits</h4>\r\n\r\n<ul>\r\n	<li>Performance bonus, Weekly 2 holidays</li>\r\n	<li>Salary Review: Half Yearly</li>\r\n	<li>Festival Bonus: 2</li>\r\n	<li>5days work (9am to 6pm).</li>\r\n	<li>7 days medical leave only.</li>\r\n	<li>Other holiday as per company calendar.</li>\r\n</ul>', '2023-01-10', '2022-12-25 12:25:39', NULL),
(3, 'Senior Graphics Designer', 'senior-graphics-designer165', 2, 'Full-time, Part Time', '<h4>Job Context</h4>\r\n\r\n<ul>\r\n	<li>Reputed companies of the country, 1 &amp; 9 Group by 1 &amp; 9 Apparel Creator Ltd. and 19Bay Industries Ltd. are looking for potential and experienced candidate for the position of Graphics Designer . We are looking to hire an Creative Graphics Designing Strong Knowledge in Clothing Mockup Video Editing Image Retouching Skill. And who has excellent written and verbal communication skills in English.</li>\r\n</ul>\r\n\r\n<h4>Job Responsibilities</h4>\r\n\r\n<ul>\r\n	<li>&bull;Clothing Mockup Skill must needed</li>\r\n	<li>&bull; Design digital media creatives for social media post, banners, blog image, ads, info-graphics.</li>\r\n	<li>&bull; Must be proficient on High End Photo retouch (Product/People), Color correction, Masking, Shadow, Background removal, Background Design.</li>\r\n	<li>&bull; Create Leaflets, Flyers, 2D Illustration, layout and Advertising materials and prepare output, check sample and Experience with color theory.</li>\r\n	<li>&bull; Experience with combining typography and utilizing typographic terms.</li>\r\n	<li>&bull; Basic Copy-writing Skills and Content Creation and Converting briefs into creative visuals.</li>\r\n	<li>&bull; Have a great sense of urgency with positive attitude.</li>\r\n	<li>&bull; Maintain brand consistency through all the projects.</li>\r\n	<li>&bull; Researching, gathering knowledge and submit report about the Competitor, Audience and Industry.</li>\r\n	<li>&bull; Make short videos ongoing events.</li>\r\n</ul>\r\n\r\n<h4>Employment Status</h4>\r\n\r\n<p>Full-time</p>\r\n\r\n<h4>Workplace</h4>\r\n\r\n<ul>\r\n	<li>Work at office</li>\r\n</ul>\r\n\r\n<h4>Educational Requirements</h4>\r\n\r\n<ul>\r\n	<li>Bachelor of Fine Arts (B.F.A)</li>\r\n	<li>Diploma in Graphics Design/ Fine Arts/ Bachelor in Graphics Design.</li>\r\n	<li>Educational qualifications may be relaxed based on experiences and expertise.</li>\r\n	<li>Skills Required: Adobe illustrator, Adobe Photoshop, Expertise in MS Office</li>\r\n	<li>Training/Trade Course: grahics design,graphics designer,illustrator</li>\r\n	<li>Skills Required: Adobe illustrator, Adobe Photoshop, Adove Lightroom, Adove Photoshop, Adove premiere pro, Graphics Design Auto CAD, shadow</li>\r\n</ul>\r\n\r\n<h4>Experience Requirements</h4>\r\n\r\n<ul>\r\n	<li>2 to 5 year(s)</li>\r\n	<li>The applicants should have experience in the following area(s):<br />\r\n	Adobe illustrator, Adobe indesign, Adobe Photoshop, Graphics Design Auto CAD, premium pro, shadow</li>\r\n	<li>The applicants should have experience in the following business area(s):<br />\r\n	Buying House</li>\r\n</ul>\r\n\r\n<h4>Additional Requirements</h4>\r\n\r\n<ul>\r\n	<li>Age 22 to 40 years</li>\r\n	<li>Both males and females are allowed to apply</li>\r\n	<li>The applicants should have experience in the following area(s):</li>\r\n	<li>Advertising Agency, Creating Visualization, Graphics Design, illustration and video editing</li>\r\n</ul>\r\n\r\n<h4>Job Location</h4>\r\n\r\n<p>Dhaka (Mirpur)</p>\r\n\r\n<h4>Salary</h4>\r\n\r\n<ul>\r\n	<li>Tk. 15000 - 25000 (Monthly)</li>\r\n</ul>\r\n\r\n<h4>Compensation &amp; Other Benefits</h4>\r\n\r\n<ul>\r\n	<li>Festival Bonus: 2</li>\r\n	<li>Mobile bill, Pension policy, Tour allowance, Credit card, Medical allowance, Performance bonus, Profit share</li>\r\n	<li>Salary Review: Half yearly</li>\r\n	<li>Festival Bonus: 2(Yearly)</li>\r\n</ul>', '2022-12-28', '2022-12-25 12:27:38', NULL);
