(6, 'Privacy & Terms', 'privacy-terms132', 'Privacy & Terms', '<h2>What personal information does DiMarz collect?</h2>\r\n\r\n<p>We use the information &nbsp;gathered from visitors to tailor their &nbsp;experience on this website. The general types of data we collect are as follows:</p>\r\n\r\n<h3>Information You Give Us</h3>\r\n\r\n<p>Any information you send us via email, the contact form, or otherwise is received and stored by us. Personal data such as your name, address, and email address may be included in this information.</p>\r\n\r\n<h3>Information Gathered Automatically</h3>\r\n\r\n<p>Most websites and online services collect some information about their users automatically. This may include information like the user&#39;s IP address, browser type and version, operating system, and other technical details.We collect &nbsp;this information is generally used for purposes like website analytics or providing a better user experience. In some cases, it may be possible for this information to be used to identify individual users.</p>\r\n\r\n<h2>Does DiMarz share the information about you?</h2>\r\n\r\n<p>Our customers&#39; and other users&#39; information is crucial to our business, so we take precautions to protect it from unauthorized access and maintain its privacy. DiMarz does not share any information collected about the user with any other third parties.</p>\r\n\r\n<h2>How secure is information about you?</h2>\r\n\r\n<p>Our Secure Sockets Layer (SSL) software encrypts the information you enter during transmission to ensure your information&#39;s security during transmission. As well as a secure server hosting location, firewall protection, controlled access, and encryption technology, we also use a secure server hosting location to protect your data. While no system is completely foolproof, we take the security of your personal information very seriously, and we use security measures designed to protect that information responsibly.</p>\r\n\r\n<h2><br />\r\nInformation sent by Email</h2>\r\n\r\n<p>Your email address will be used to communicate with you or send you promotional emails based on your interests if we have obtained it for communication or promotion purposes. In the event that you no longer wish to receive our Email communication, you can revoke your consent at any time by visiting our Email Subscription Center.</p>\r\n\r\n<h2>Copyright &amp; Trademarks</h2>\r\n\r\n<p>All content on dimarz.com - including the text, images, videos, and other media, as well as the design and styling of all content - is owned exclusively by DiMarz. Or by third parties who give their permission for DiMarz to use it. All content displayed on dimarz.com is subject to diMarz&#39;s copyright.</p>\r\n\r\n<h2>Terms of Service, Notices</h2>\r\n\r\n<p>Your privacy is important to us.If you have any concerns about privacy at DiMarz, please get in touch with us- we&#39;ll try to address it for you. Our business constantly changes so the Privacy Policy could change too and we encourage people to check this site frequently for updates to these policies. That way your use of information will be subject to whichever policy is effective when you contact us or otherwise use the information collected through this site.</p>\r\n\r\n<h3>Payment</h3>\r\n\r\n<p>The price is due in full after confirmation of the order.Payment is made in the following ways: Use the secure payment interface to pay by credit, Visa or Mastercard.</p>\r\n\r\n<h3>Securing Payment</h3>\r\n\r\n<p>DiMarz offers an online payment security system that encrypts the transmission of bank details.</p>\r\n\r\n<h3>Late payment</h3>\r\n\r\n<p>Without prior notice, any amount not paid at maturity will bear interest at the legal rate.</p>\r\n\r\n<h2>Refund Policies</h2>\r\n\r\n<p>Refunds will be processed and mailed within 30 business days of the date of cancellation, using the method of payment that was agreed upon. In the case of credit card payments, refunds will be made to the same credit card number that was used at the time of purchase, and for debit card / bank payments, refunds will be issued to the same account.</p>', '2022-12-24 09:46:49', '2022-12-25 12:57:09'),
(8, 'Terms And Conditions', 'terms-and-conditions115', 'Terms And Conditions', '<p>These terms and conditions outline the rules and regulations for the use of DiMarz&#39;s Website, located at http://localhost/dimar_pro.</p>\r\n\r\n<p>By accessing this website we assume you accept these terms and conditions. Do not continue to use DiMarz if you do not agree to take all of the terms and conditions stated on this page. The following terminology applies to these Terms and Conditions, Privacy Statement and Disclaimer Notice and all Agreements: &quot;Client&quot;, &quot;You&quot; and &quot;Your&quot; refers to you, the person log on this website and compliant to the Company&rsquo;s terms and conditions. &quot;The Company&quot;, &quot;Ourselves&quot;, &quot;We&quot;, &quot;Our&quot; and &quot;Us&quot;, refers to our Company. &quot;Party&quot;, &quot;Parties&quot;, or &quot;Us&quot;, refers to both the Client and ourselves. All terms refer to the offer, acceptance and consideration of payment necessary to undertake the process of our assistance to the Client in the most appropriate manner for the express purpose of meeting the Client&rsquo;s needs in respect of provision of the Company&rsquo;s stated services, in accordance with and subject to, prevailing law of Netherlands. Any use of the above terminology or other words in the singular, plural, capitalization and/or he/she or they, are taken as interchangeable and therefore as referring to the same.</p>\r\n\r\n<h2>Cookies</h2>\r\n\r\n<p>We employ the use of cookies. By accessing DiMarz, you agreed to use cookies in agreement with DiMarz&#39;s Privacy Policy. Most interactive websites use cookies to let us retrieve the user&rsquo;s details for each visit. Cookies are used by our website to enable the functionality of certain areas to make it easier for people visiting our website. Some of our affiliate/advertising partners may also use cookies.</p>\r\n\r\n<h2>License</h2>\r\n\r\n<p>Unless otherwise stated, DiMarz and/or it