INSERT INTO `sub_categories` (`id`, `category_id`, `name`, `slug`, `comment`, `short_info`, `description`, `created_at`, `updated_at`) VALUES
(1, 1, 'Lead Generation', 'lead-generation', 'For Mainpage', 'Lead generation is a process of searching for people who are probably interested in your service and getting in contact with them to communicate further and convert.', '<h2>Find Your Targeted Audience</h2>\r\n\r\n<p>Lead Generation services are a fundamental segment of growing your business&#39;s revenue.</p>\r\n\r\n<p><strong>As per the Web Report, 85% of B2B marketers say lead generation is their most important content marketing goal.</strong></p>\r\n\r\n<p>That is why we create solid lead-generation strategies for you to present organized &amp; updated leads about your products and services. To bring new customers into your sales funnel and convert them into your target audience, you need top-notch leads, and that&#39;s why many companies invest in lead generation services. With lead generation, you can find your targeted company, their revenue, number, email &amp; much other information that can help quickly reach your audience.</p>\r\n\r\n<h2>Get Qualified leads With DiMarz</h2>\r\n\r\n<p>Dimarz provides customized support tailored to your business&#39;s needs&ndash; we can make it happen no matter what type of leads you want. We have an expert team of lead generation that can get you the results you need. Using our services, you can acquire more qualified leads for your company.</p>', '2022-12-15 10:56:22', '2022-12-21 16:50:48'),
(2, 1, 'SEO', 'seo', 'For SEO', 'With SEO Campaign Boost your organic traffic & bring more Conversations.', '<h3>Importance Of SEO</h3>\r\n\r\n<p><strong>According to global Research, 51% of all website traffic comes from organic searches.</strong></p>\r\n\r\n<p>But many websites aren&#39;t getting the audiences they deserve. Why? Because most of the sites on the internet need to be appropriately Search Engine Optimized. DiMarz has got the solutions for your SEO.</p>\r\n\r\n<h3>We Know What Works For You</h3>\r\n\r\n<p><strong>&quot;High-quality content and links are the best way to rank well on Google.&quot; - Search Engine Land.</strong></p>\r\n\r\n<p>So, our experts will optimize your website for search engines with smart, healthy &amp; best search engine approaches that will help you to get the top spot of any SERP(Search Engine Ranking Position). We will handle &amp; optimize your Content, keywords, landing pages, and other significant aspects to bring the best results.</p>\r\n\r\n<p>By deeply auditing the Technical, On-Page &amp; Off-page status of your website and applying persuasive SEO strategies, your website will gain more traffic to your website. DiMarz will make sure of that.</p>', '2022-12-19 06:37:52', NULL),
(3, 1, 'Email Marketing', 'email-marketing', 'For Email Marketing', 'Directly Reach Your  potential Target Audience with the email marketing.', '<h3>Email Marketing | A Potential Weapon To Scale Up Businesses</h3>\r\n\r\n<p><strong>&quot;A majority of marketers using email leverage mobile-friendly emails as part of their marketing strategy.&quot;</strong></p>\r\n\r\n<p>Email marketing plays a vital role in the Digital Marketing sector as it is a direct ticket to advertise your product to potential customers. A well-organized campaign can bring more significant revenue, higher ROI, and more engagement to your brand. &nbsp;&nbsp;</p>\r\n\r\n<h3>We Ensure Minimal Bounce Rate &amp; Decent Engagement.</h3>\r\n\r\n<p>The first thing everybody fears about email marketing is the heavy bounce rates, which leads people to take it as a waste of money. But it&#39;s different with DiMarz. We value your time and money. Our campaign will ensure a decent brand engagement and a minimal bounce rate. With the latest technologies and Research, we will ensure a decent result with our service.</p>', '2022-12-19 06:39:15', NULL),
(4, 1, 'Content Writing', 'content-writing', 'For Content Writing', 'Make high-quality content that works to increase visitors from organic search.', '<h3>Assurance of Unique, Error-Free &amp; Original Contents</h3>\r\n\r\n<p>Everyone expects their Content to be error-free, original, and unique. We can assure you that. Our experienced writers will provide well-researched, spam, plagiarism, grammar &amp; spelling mistakes free content. And yes, we are against paraphrasing, rewriting, or duplicate writing to ensure that you get engaging, easy-to-understand, and SEO-friendly Content.</p>\r\n\r\n<h3>We Cover Various Industries&nbsp;</h3>\r\n\r\n<p>You must need content writing services if you belong to Agencies, enterprises, Publishers, E-Commerce, or any industry. Our experts can handle any writing, such as articles, blogs, product reviews, social media content, etc. We maintain the quality and freshness of the contents. Providing the best service is our primary objective.<br />\r\n&nbsp;</p>', '2022-12-19 06:39:45', NULL),
(5, 3, 'WordPress Development', 'wordpress-development', 'For WordPress Main page', 'Design, Optimize, Maintenance & build your websites with WordPress.', '<h2>Choose WordPress For Your Business</h2>\r\n\r\n<p>Wordpress is a popular content management system (CMS) that is easy to use and has many features, making it an excellent choice for any business. One of the best features of wordpress is the easy-to-use administration panel. This panel includes a variety of tools that can be used to customize your websites, such as a Custom Fields Panel, Security Panel, and more.</p>\r\n\r\n<p><br />\r\n<strong>Based on statistics, WordPress is used by 43.2 percent of all websites.</strong></p>\r\n\r\n<h2><br />\r\nWordPress Services Provided By Us</h2>\r\n\r\n<p>DiMarz delivers a lot of WordPress development services which are most suitable for your websites.We can provide you with the best services possible and will be able to guide you through every step of your project.We are a WordPress development company with considerable knowledge. So if you&#39;re looking for an affordable and reliable Wordpress development company, DiMarz is a perfect choice!</p>\r\n\r\n<h2>&nbsp;</h2>', '2022-12-19 13:20:05', NULL),
(6, 3, 'Web Application', 'web-application', 'For Web Application MainPage', 'Intuitive and secure web solutions that help drive your business\'s success.', '<h2>Web Application Development: necessaries and prospects</h2>\r\n\r\n<p>Web application development is a growing industry that offers many benefits to businesses. By building web applications, companies can reduce costs and time while increasing their security and efficiency. Additionally, web application development can help companies grow their customer base and increase profits.</p>\r\n\r\n<h2>Why We&#39;re The Best Choice For Your Business</h2>\r\n\r\n<p>DiMarz &nbsp;is a full-service web development team that provides web application design and technical support for your Business. We build web applications using the best tools, including modern programming technology. DiMarz also provided you with custom web development services. Our goal &nbsp;is to construct websites with full implications for your growth potential at a low expense.<br />\r\n&nbsp;</p>', '2022-12-19 14:17:34', NULL),
(7, 3, 'Front-End Development', 'front-end-development', 'For Front-End Development MainPage', 'Creative frontend engineers give you highly responsive, attractive, user-friendly websites.', '<h2>User Friendly &amp; Optimized Front-End Development</h2>\r\n\r\n<p>Front-End is the face of a website. It determines the look and feel of your web application. So, we will develop a user-friendly and fully optimized front-end structure that will give your traffic a different experience that they will like. All you need to do is describe what you want, and our developers will create it.</p>\r\n\r\n<h2>We are Covering The Most Demanded Services</h2>\r\n\r\n<p>Front-End development is a thriving sector and has various kinds of services. We use technologies like HTML, CSS, JavaScript &amp; REACT. From front-end designing to converting HTML to other frameworks like CSS or React, anything is possible with DiMarz.<br />\r\n&nbsp;</p>', '2022-12-19 14:21:01', NULL),
(8, 3, 'Back-End Development', 'back-end-development', 'For Back-End Development MainPage', 'Back-End development  helps create intricate server-side layers, enabling cloud integration.', '<h2>Build a Strong Foundation of Your Web Application</h2>\r\n\r\n<p>The Back-End part of your website is the driving force which ensures the performance and efficiency of your web application. &nbsp;It will ensure that your web servers, applications, and databases run effectively by using various types of web technologies.&nbsp;</p>\r\n\r\n<h2>Smart Back-End Development Services By DiMarz team</h2>\r\n\r\n<p>DiMarz can create customized backend options for web applications &nbsp;for your websites. Whatever your requirements, our backend development team will provide you with a tailored solution that will help you achieve your goals. We also utilize technologies to help our customers build innovative products and solutions.<br />\r\n&nbsp;</p>', '2022-12-19 14:24:35', NULL),
(9, 4, 'Photo Editing', 'photo-editing', 'For Photo Editing MainPage', 'With the  expert photo editing service, take your pictures to the next level.', '<h2>Different Type Of Photo Editing Services</h2>\r\n\r\n<p>Photo editing services are a great way to make your photos look more professional and attractive. There are many different types of photo editing services available, like Background Removal Services,eCommerce Photo Editing, Advance Photo Editing, Real, Estate Photo Editing, Photo manipulation, Vector Illustration &amp; Digital Art<br />\r\nso you can find the right one for your needs.</p>\r\n\r\n<h2>Choose The Perfect Service For You</h2>\r\n\r\n<p>When you want to have a photo edited, find an agency with the skills and experience to do a great job. are many different types of photo editing, each requiring a specific approach. We have a photo editing team who will deliver the work per your requirement. If you want your photos to look their best, you can communicate with our team Dimarz.<br />\r\n&nbsp;</p>', '2022-12-19 14:26:30', NULL),
(11, 4, 'Professional Design', 'professional-design', 'For Professional Design MainPage', 'With Photo Design, you get an opportunity to showcase your company\'s visual identity.', '<h2>Why Your Business Needs A Designer</h2>\r\n\r\n<p>Graphic design is a valuable service that can help your business stand out. It can create a visual identity for your company and help to communicate your message to customers. Graphic designers can help you create better marketing materials. They can create brochures, advertise your social media campaigns, website designs, logo design, and Motion graphics.</p>\r\n\r\n<h2><br />\r\nHire a Graphic Design Company</h2>\r\n\r\n<p>DiMarz is a professional graphic design service provider that creates stunning visuals for brochures, banners, flyers, business cards, logo design, social media design, and many more. Our team of expert designers can help you establish an attention-grabbing profile in the online world with our complete professional services.<br />\r\n&nbsp;</p>', '2022-12-19 14:28:19', NULL),
(12, 2, 'Online Data Entry', 'online-data-entry', 'For Online Data Entry MainPage', 'Online data entry is  an excellent way to quickly and easily enter the information.', '<h2>Benefits Of Online Data Entry</h2>\r\n\r\n<p>The daily hassle of dealing with large volumes of data continues to pose a formidable problem for organizations &amp; businesses. It is essential that an Error-free, efficient, and easily accessible data format is maintained for a smooth and error-free business.In order to help you easily access and retrieve business-critical data or collect your data from different sources, DiMarz offers the best online data entry services.&nbsp;With our perfect processes, a highly-skilled team of data entry operators, the best infrastructure, and stringent security measures, you can stay assured that your online data entry project is in safe hands.</p>\r\n\r\n<h2><br />\r\nDiMarz&ndash; your trustworthy data entry outsourcing partner</h2>\r\n\r\n<p>We use the most advanced technology to ensure perfect delivery outputs that are high in quality and accuracy. By Outsourcing your Data entry project to us, you can Save up to 65% to 75% of the company&#39;s expenses<br />\r\n&nbsp;</p>', '2022-12-19 14:31:39', NULL),
(13, 2, 'Offline  Data Entry', 'offline-data-entry', 'For Offline  Data Entry MainPage', 'Take your operational efficiency to the next level with offline data entry services.', '<h2>Importance Of Offline Data Entry</h2>\r\n\r\n<p>Offline data entry is the process of entering information into a list, spreadsheet, database, or word processing program without the need for a Web connection.<br />\r\nA well-organized and Error-free Data is the primary demand of every organization in the digital world.</p>\r\n\r\n<p>As per Research,60% of companies feel that their overall data quality is erratic.&nbsp;</p>\r\n\r\n<p>Our Offline data entry Service is the perfect option for you to get accurate &amp; Well organized Data. With our skilled data entry teams and years of industry experience, we can enhance your business processes by providing appropriate Data.</p>\r\n\r\n<h2>Get well-organized Data From DiMarz</h2>\r\n\r\n<p>DiMarz follows a dynamic process to ensure you a high level of speed, accuracy, and ease of understanding. We strive to provide professional &amp; Error-free offline data entry services that match standards in terms of timeliness and efficiency.&nbsp;<br />\r\n&nbsp;</p>', '2022-12-19 14:33:24', NULL);
